"categorystrlist":"Desserts,         Dim Sum,         Bakeries",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/yeM3iB1e_-QdFw0W9NHh1g/l.jpg",
"rating":"4.0",
"reviewcomment":"Food was just amazing, tried a lot of the good recommendations from Yelp reviews, and yes, you have to HAVE to have the jasmine tea ribs. Was just the best thing that has hit my taste buds!!!<br><br>There was a tofu dish that was just amazing too, and chilli squid was really tasty.<br>Heard about this place a lot and finally ventured in. Restaurant itself not amazing, bit too clinical for me, but when you&#39;re I good heaven you don&#39;t notice it!<br>My waitress was pretty useless at recommending anything, kept saying well if you like it then it&#39;s good, thanks for that useful tip!<br><br>But was a great lunch and kept me full for hours!",
