"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Ge5OHPDObB26llmAcEgGWA/l.jpg",
"rating":"4.0",
"reviewcomment":"As an American living in London, life can be tough if not impossible when you can&#39;t get quality BBQ food. Bodean&#39;s certainly helps rectify the situation. <br><br>Bodean&#39;s is always packed and you should always expect a queue. My favorite is the Soho special, which combines burnt ends (the house specialty) and pulled pork. Match made in heaven if you ask me. Their cornbread is also pretty decent and they have pretty good wings. I&#39;ve never tried their ribs *gasp* but I have friends that swear by them. I also appreciate the North American bottled beer selection which includes Blue Moon, Coors, and Brooklyn Brewery. Of course I appreciate local British and European beers, but sometimes you just need a taste of home.",
