"reviewcomment":"Summary: <br>+ GREAT food AND DESSERT<br>+ Spacious and chic ambience <br>+ Order at the counter, which also serves as food display<br>+ Follow the sight of food, follow your heart <br>+ But remember, your eyes are bigger than your stomach <br>+ It gets very busy. So be ready to elbow your way in to find a spot <br><br>Overall: <br>Located in the heart of Wardour Street, this gorgeous Italian deli café is one of my favourite places in SOHO. They have freshly baked breads, steaming hot pizza, salad bar, hot main dishes and great cakes. In other words, they have EVERYTHING. <br>From outside, the place looks like a chic hotel restaurant. The interior does not betray your expectation. The dusky brightness of brass tables somehow matches the white marble walls and dark stone floor. The combination gives this large dining space a tasteful refinement without being glitzy. <br><br>The place is apparently called Princi. <br>I can never remember what it is called. The place is too stylish to have a big banner of their name at the back of the counter. The only branding they have outside the restaurant is very small and the fancy swirly font makes it impossible to decipher what is written. So when I refer to this place, I am usually forced to use rather unsophisticated descriptions such as &#34;that big posh Italian place in SOHO&#34;. <br>Hopefully, writing a review will help me remember the name of this charming café. <br><br>Anyway, the place was as busy as usual when I went in for a dessert break. (I seem to do that a lot these days.) I often see one or two creative types with their laptops (mostly Mac) here but there were none of them that day. God knows what those people do for their lives <br><br>I joined the group of people who are forming a kind of &#34;organic&#34; queue that you see in good old British pub. <br>When I felt I had waited for a sufficient amount of time as a courtesy, I attracted an attention of one of the servers at the cake section and ordered Cremoso alla fragola (layered berry mousse cake).  <br><br>Food: <br>This three-layered delight came in the shape of a fluffy strawberry mousse sandwiched by a thin sheet of mixed berry jello on top and moist sponge at the base. The little bits of fresh berries in the top jello layer enhance the airy texture of the cake. I like the way all the elements worked together without one dominating another.  <br><br>One other thing to mention is their toilet smells incredible. They have some sort of lemon grass incense that fills the private space with heavenly fragrance. That said, I have only been to male toilet. So I can&#39;t speak of female one. <br><br>I only went there for a tea this time but they also have great food and bakery section. Maybe I will review them next time.",
