"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/WDOj-hThjMeNt6lbz1753w/l.jpg",
"rating":"4.0",
"reviewcomment":"The ambience of MEATliquor is something of an experience, with red lights and decor to resemble a slaughter house; this is not the place for a vegetarian to go. (Although they do have 1-2 meat free options).<br><br>We waited less than most people do, and although it felt a bit long, it was nice to stand at the bar and chat with friends. If you&#39;re in a hurry, this is not the place for you. <br><br>Food wise it is greasy as all other reviews say, to the point where you are given a kitchen towel roll to wipe your hands and arms as the grease goes everywhere. <br>My personal favourite was the Bingo Wings, and I would be happy to go there just to have those wings again. They are a must to try!<br><br>It&#39;s not as expensive as you think it would be, with the burgers ranging from £6.50 - £9, and they are filling.<br><br>All in all it is a nice experience with friends, but you need to have extra time on your hands, and be ready for some greasy hands as well.",
