"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/rxBuKtGvon8sUfMYYxwjGw/l.jpg",
"rating":"4.0",
"reviewcomment":"Loved everything about this pub - it&#39;s one of the oldest pubs in London, which made the experience even better. <br><br>Located on Fleet Street, keep your eyes peeled when looking for this place. It&#39;s tucked away in an alley and can be easily missed. We walked right past the alley a few times before finally finding it. <br><br>There are three levels, you have to take a flight of really tricky stairs to go to each. You literally have to hunch down to get through - I hit my head going back up when we were leaving, so be extra careful. <br><br>We went down to the 2nd level and found some seats. The place is really charming. Loved the ambiance - it&#39;s dark and candle-lit, but still very lively. Definitely felt historic. As we sat down, there was a huge group of Brits trickling in for what seemed like a family reunion; they were having an awesome time. It kind of felt like we were watching a British movie, haha! <br><br>You seat yourself and to grab drinks and food, you have to go down to the basement level, which was my absolute favorite. Sadly, it was way too packed, so we couldn&#39;t find a seat down there. <br><br>Their fish &amp; chips were DELICIOUS! Just what I had been searching for. Definitely the best I had during my trip and believe me, I tried it at several popular places.",
