"reviewcomment":"I have to admit that I wasn&#39;t thrilled to go to a vegetarian restaurant, but one of our friends had requested Mildreds and so we went with it.  To my surprise, Mildreds was really good!<br><br>Food: We ordered the Mexican platter and panfried halloumi to share for appetisers.  For entrees we ordered the detox salad with goat cheese, the burrito and two jack burgers with fries.  I ordered the burrito which was super delicious and I highly recommend it!<br><br>Drinks: We ordered four bellinis and two fresh juices.<br><br>Price: For four people we paid 102.77 GBP.<br><br>Ambiance: The restaurant is busy on the weekends so be ready to wait.  It&#39;s loud and the seating is tight.  Note: The bar doesn&#39;t serve anything but bread and olives so you can&#39;t order apps while waiting.  The restaurant seems popular with younger people.  There was a large group of young people next to us who were incredibly loud and obnoxious. Even though we were only a group of four it was very hard to hear what we were saying even though we were sitting next to each other.  <br><br>Service: The service was ok.  The hostess and the server weren&#39;t the most friendly.  <br><br>Would I go back?  Yes, but I would go early to have a pleasant dinner and not have to deal with the noise level because the food is actually very good and is the saving grace of this restaurant.",
