"rating":"3.5",
"reviewcomment":"I was here during the summer. It was part of a week long visit to London. The day before I left, I decided to check this place out. <br><br>It was pretty chill (no pun intended). It was tough to get around though. People were just standing around checking out the sculptures if they weren&#39;t at the bar getting drinks in the ice glasses. No, seriously, the glasses are made of ice.<br><br>The people I met here while inside are like those I would meet at a regular club. But its mostly toward tourists (like me) and it was fun. Being from Hawaii it was my first time drinking in a place like this (outside of going to a midwest bar in 20 degree weather). I&#39;d go again but only to get out of the summer heat.",
