"reviewcomment":"We had friends who recommended this restaurant to us, so my wife and I booked it as our classy dinner for our week in London. The staff was professional from the start. While there were lots of staff, everyone seemed to stay busy but relaxed, working well together. The room is well-lit with large windows that look out on Hyde park. We had noon reservations and were seated immediately. We both did the set lunch menu, which has 2 options for each course. I ordered the first option of each course and my wife ordered the second options, which meant that we could share and each try both. <br><br>All our dishes were interesting and well executed. A memorable point was the octopus in our salad; it was very tender and appeared to be thin cross sections of bundles of octopus. The quail and pollock were flavorful.<br><br>I felt that the set lunch menu and experience was a good value for the price.",
