"rating":"3.5",
"reviewcomment":"This restaurant is a self service where you order the food at different counters and they cook is fresh in front of you, this place can be quick once you get served otherwise it&#39;s just the queuing that takes the time. The actual serving of the food is quick.. You order the base of a dish and then can choose your choice of pasta ..For seating is fight for the first place haha it&#39;s ok in the quiet times but avoid during rush peak times..<br><br>The atmosphere is very loud though so not great for a first date..again this is when it is busy the rest of the times it can be quiet..<br>They don&#39;t rush you out of the place which is a bonus once you find your perch.. <br><br>Food is flavoursome and portions are filling I usually order the Chilli Chicken with my choice of pasta, it&#39;s not too spicy and I usually have to add extra chilli oil from the table.. The portion is filling..<br><br>They also have a self serving salad bar and pizza selection.<br><br>The drinks options are sodas behind the food counters but they have a full bar selection at a different counter.. <br><br>Average price of pasta dish £6-11<br>Depends on your budget but you&#39;ll find a meal ;)",
