"reviewcomment":"Last Saturday we went to Tokyo Diner. It was a great choice. We were also very lucky because we got seated right away, but immediately after us (around 7.30) people started to line up.<br><br>Tokyo Diner is all about one thing: great standard Japanese food. The setting of the restaurant is very basic and small (don&#39;t dress up for this). All staff is Japanese and very friendly &amp; humble. They refuse any tips because &#34;it&#39;s not part of the Japanese culture&#34; (their words). They don&#39;t sell Tuna because they believe in only serving sustainable food. As much as I love tuna, I can only truly admire this choice and position they take.<br><br>The food was really good. We didn&#39;t eat as much as we normally do at a Japanese place but had a fair amount of salmon sushi (really fresh), pork with curry (tasted like other ones I had before) and Udon noodles (almost the most recommendable dish of the menu! Only £8 for the noodles with chicken and better than any other trendy Udon place I&#39;ve been to in Soho).<br><br>Overall, all the prices are VERY reasonable (almost cheap) for such quality! It&#39;s about £2-3 for a beer for example. And the total bill (and in the end, we were full) was only £50 for several beers, glasses of wine, fresh sushi, pork, udon ... <br><br>I definitely go back when I&#39;m around in Chinatown!",
