"reviewcomment":"Had breakfast at the Orangery and loved it. <br><br>We made reservations that morning because we were worried we wouldn&#39;t be able to get a table otherwise-luckily, it wasn&#39;t busy that day and we had a very pleasant breakfast. However I have heard tell tale of long lines and waiting, so I would recommend making a reservation if you can just in case. <br><br>I decided to get the French toast, while the other members of my party chose the Full English breakfast. They were all delicious. With each meal also comes a pot of tea (per person), as well as toast (white, wheat, or both). I chose the breakfast blend tea, and loved the flavor. It went very well with my toast. <br><br>The table setting is very nice, they give you the plates and cups with the Kensington Palace exclusive decorations on them. Table is white table cloth. If you sit at a table by the window, you can look outside and enjoy the view of the palace gardens as well. <br><br>Would highly recommend!",
