"rating":"3.5",
"reviewcomment":"4 stars for the gooey cheesy shroomburger alone. which I ordered because I haven&#39;t heard stellar things about the burgers themselves and I have high standards and also, it&#39;s good to be veggie once in a while!<br><br>So, on with the literary food porn - Deep fried portobello mushrooms, sandwiched together with gooey cheese. with crispy lettuce. Just heaven. <br><br>I tried a bit of my friend smokeshack and it was a solid burger but it&#39;s not wow worthy! <br>We also ordered two portions of crinkle cut chips which were lovely if a little on the small portion size and we&#39;re small asian girls, but we eat like elephants yeah? It&#39;s the world&#39;s paradoxes! <br><br>Topped it off with a shake because I wasn&#39;t really feeling concrete just yet! Black and white shake is amazing! I really want one now actually.<br><br>I find the seating quite haphazard, as in, it&#39;s not a service restaurant so I don&#39;t know why there are SO many servers. It&#39;s a bit too much happening. I mean, you supposed to order then pick an area you want to sit and then bring your buzzer to the table where they have two seaters who look for seats for you, that&#39;s their job I assume. And about 3 people are standing at the food collection point to give you ONE tray. They were lovely especially when there was a ketchup queue, and they would go around serving ketchup and mayo but overkill much?<br><br>PPS: I&#39;m writing this review on some shack glasses I asked very nicely for at the PR launch like way back.",
