"reviewcomment":"Summary:<br><br>+ Great weekend brunch/ breakfast at a trendy and casual café <br>+ That pretty much sums up all... <br><br>Overall: <br>I don&#39;t know what else I can possibly add to the super concise summary above not to mention milliards of reviews from dedicated and well-informed yelpers on this page. <br>Oh, did I say this place is great? I probably have...<br><br>The food at The Table Café is without a doubt of top quality among restaurants that serve brunch/ breakfast. It is also a very stylish café with modern wooden furniture and bare concrete that make this place look like a gallery of a modern artist. The large windows bring in a lot of natural light into the large open space. <br><br>The café serves famous brunch on Saturdays and Sundays. There is usually a queue outside but I have never waited for more than 5 minutes. Sometimes you have to share a long table with other people. (Majority of tables are long ones.) <br><br>I have tried eggs dishes, pancakes and waffles so far and I can tell you they are all good. Oh, the eggs. So soft and tender. Before the perfect hollandaise sauce I surrender. Wait, I just rhymed there! <br>It&#39;s so good that it makes me want to pull of some haiku although I have no idea how. <br><br>My only trouble is that the portion is not so big here. And I eat a lot. So sometimes I have to get an egg dish AND a pancake (or a waffle) to fill me up. <br><br>I have also been here for a party of a friend (the café also does event hire) and the food there was lovely too. I haven&#39;t had lunch or dinner but I&#39;m sure they are good too.",
