"reviewcomment":"When I came in on a Friday evening to find the place almost empty, I had some concerns. It&#39;s never a good sign when a restaurant is empty on a Friday night. I&#39;m still unsure as to why there was barely anyone here for dinner, because the food was great. I had the horseradish bashed potatoes (slightly textured, not buttery smooth like the mashed) and the pie of the day which was a lamb pot pie. The potatoes were delicious and the pie was amazing. Flaky crust with perfectly cooked lamb inside. The sausage of the day was a wild boar apple sausage, and that was really good as well. <br><br>Definitely worth a try if you&#39;re in the area. Very well priced, too.",
