"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/L5YdLCU_LDjHDZ0zt1b2rg/l.jpg",
"rating":"4.0",
"reviewcomment":"Absolutely love this place. There can be long queues, especially at popular dinner and lunch times, but totally worth it. I&#39;ve tried both the burger and lobster roll, and have never been disappointed. The lobster roll is packed with lobster meat and served on a delicious buttered brioche roll (yes, that bun alone might be a heart attack, but lipsmacking good i say!). The burger almost seems expensive at 20 pounds compared to the lobster and lobster roll, which are all offered at the same price, but definitely one of the great burgers of London.<br><br>This restaurant has been expanding around London, but I&#39;ve only been to the Mayfair and Soho locations which are very different in terms of ambience (same amazing level of food). The Mayfair location is smaller and feels more intimate while the Soho location has more tables and feels more modern. These locations have different perks but you really can&#39;t go wrong when burger or lobster is involved!",
