"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/xZccyiYDZ0KYvfh_dy-NQw/l.jpg",
"rating":"3.5",
"reviewcomment":"One year ago today, my husband and I dined at Barbecoa on our first night after moving to London.  Since then, we have taken a number of friends and family visiting, and it will forever be one of our favorites in the city as we move back to the States.  <br><br>The view of St Paul&#39;s is gorgeous (after dinner, take the elevator in One New Change to the rooftop for more amazing views).  The service is of the standard that Americans are more used to.  The steak is perfect - we aren&#39;t fans of British beef, but Jamie does it right.  The servers will take as much time as necessary to assist with the menu.  The wine list is commendable, as well as the cocktail list - so many to try!  <br><br>I highly recommend it for tourists who want a good meal with a view, or for a nice dinner date, or for a farewell meal after a great year living in the UK!",
