"categorystrlist":"Italian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/kAr967P_7M2EhVHsz10oRQ/l.jpg",
"rating":"3.5",
"reviewcomment":"For my one year anniversary in London I figured I should go somewhere a bit nice, a bit London, a bit special. Unfortunately a dental affliction meant I was limited to the softer side of the food pyramid so I decided not to blow massive cash on food I couldn&#39;t chew properly and went with soft, safe, Italian.<br><br>There was a bit of a wait (30 minutes), and not a lot of room at the bar, but it wasn&#39;t altogether unexpected on a Friday night so no big deal. We got taken downstairs to basically the perfect table - corner booths for the win!<br><br>We ordered the meat board for two as a starter, carbonara and lasagna for the mains. Everything was tasty, looked great on the plate and considering how busy the restaurant was, the service was fast too. It wasn&#39;t the best carbonara I&#39;ve ever had, but the lasagna was amazing.<br><br>I wish I could say that I got dessert as well, but I thought the menu was a bit boring so gave it a miss.",
