"rating":"3.5",
"reviewcomment":"I&#39;ve been on a search for good pho in London for a while and so far, Song Que ranks high up there for me. Don&#39;t get me wrong, the search continues, but I&#39;m always happy to come here. <br><br>It&#39;s always busy, and don&#39;t be surprised if they seat you right next to another family or better yet, a couple on an awkward first date. This happened to me last night and it was very endearing basically sitting in on their date but also a bit awkward. All part of the experience!<br><br>I opted for #135 which is the pho with rare beef, tendon and tripe. I most often get the &#34;special&#34; which at Song Que, I&#39;ve determined this pho to be. The portion is generous, and cheaper than the green pho place across the road (can&#39;t remember its name!) The spring rolls are consistent and tasty. I haven&#39;t tried anything else, simply because these are my go-to Vietnamese items. I did go with a vegetarian once and she was in love with the bun noodles and found no issues with finding tasty things on the menu.<br><br>If you are confused about which place to pick on Kingsland road for a good pho place, Song Que is a good bet!",
