"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/X-N3vnJ-DOLIAplpX14ipg/l.jpg",
"rating":"4.0",
"reviewcomment":"It is the best fish &amp; chips I had. Mind that the place is separated between take away (cheap!!) and dining in (not that cheap). <br><br>I had plaice in egg matzo coating. It was basically fried in batter, but it was light, crispy and not oily at all. The batter puffs up so it looks like your portion of fish is HUGE, but it&#39;s not, the regular portion is just big enough to satisfy a standard hunger. Side spinach, coleslaw and pickled onion were all good. They also serve everything with ketchup bowl and tartar sauce bowl - free of charge.<br><br>The service was friendly and very attentive (it helped that we were the only people in the restaurant! - it was their first opening on a Sunday). I liked the ambiance of the place - very cozy, wooden furniture, dark red seating - good space.<br><br>I just wish it was a tad bit cheaper - it&#39;s twice/thrice more expensive comparing to its sister take-out next door.",
