"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/H39S4NQfAVe7QR9tvpajZg/l.jpg",
"rating":"3.5",
"reviewcomment":"I usually go here for Breakfast. They have the &#39;Early Bird&#39; special before 08:00, so get yo&#39; ass down there for some great food. My friend usually has the porridge, which she says is really good. I, on the other hand, prefer something a bit more substantial for breakfast and alternate between the full english (Full Borough I think they call it) and the &#39;to-die-for&#39; caramelised bananas with french bread and bacon. Simply perfect.<br><br>The dinner and lunch services are very good too, quintessential British food at its finest. Their steaks are really good, and they cook all the food very well. The waiting staff are very polite and helpful, happy to accommodate any needs. What I would say is that if you have a vegetarian with you, this might not be the best place to go as it is very meat-orientated.<br><br>N.B.: When calling to make a reservation, ask for a window seat. That way you can enjoy your meal looking out across St Paul&#39;s Cathedral and the amazing views of London.",
