"rating":"4.0",
"reviewcomment":"I went with my husband and a friend on a Wednesday night.<br><br>I was hungry and the friend was thirsty. It all worked out well.<br>Ordered some food off of the menu, beers, soda and an assortment of other little delights.<br><br>It was pretty busy at about 6 or 7pm.<br>We found a table though....<br>I don&#39;t recall the music being played as it was rather loud to begin with.<br><br>I will definitely be back when I return to London to eat, to drink and to check out the music.<br><br>I read somebody posted about &#34;locals only&#34;.<br>Fuck, I&#39;m from Los Angeles. I think they&#39;d have noticed by my distinct lack of accent that I&#39;m not a local. <br>Nobody cared. Just go and have a good time.",
