"reviewcomment":"Drink: order lychee martini,  it was good as most of thirty cocktail tend to taste sweeter.  But if u r into strong achoholic taste,  Nobu cocktail may be not for u, instead,  u can try their sake.<br><br>Food: heard about this restaurant for long time and their famous waiting time for reservations.  Compared to other fusion restaurant I have tried, the food here is better than average,  but also a bit over rated. <br><br>The best dishes are the prawn tempura with their amazing three dipping sauces,  salads are good too with nice dressing, their seafood main courses r very good . <br><br>But I am disappointed by their sushi compared to other similar restaurant.  There are gaps for improvement to perfection. <br><br>Tacos are interesting,  the filling are good, but Tacos can be more crispy to make the dish work better. <br><br>Desserts are better than normal restaurant,  but  less innovative compared to similar restaurant I have tried in London.",
