"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ayi2ODY3JWZCJMGYmOhn6A/l.jpg",
"rating":"4.0",
"reviewcomment":"- the Bar Boulud is the sister restaurant to the popular New York outpost<br>- located at Mandarin Oriental Hyde Park<br>- reservation is highly recommended! very busy and popular<br>- the service staff is impeccable, from the front door staff to the barman to our waiter; very very obliging, friendly and alert staff!!<br>- great atmosphere, nice interiors (sleek open kitchen, vaulted ceilings, red-leather banquettes and zinc-topped bar create a comfortable and welcoming surrounding); however, very narrow seating (this is really a minus!)<br>- the seasonal bistro menu includes an impressive selection of house-made terrines and pâtés, as well as a handful of signature sausages and burgers, adding an American touch to this French inflected bistro and wine bar<br>- the wine list focuses on Burgundy and the Rhône Valley, including many fine selections by the glass, as well as a wide array of draught and bottled beers<br>- starter: &#34;CHARCUTERIE DE GILLES VEROT&#34;: chef&#39;s selection of pâtés terrines,sliced meats, hors d&#39;oeuvres, pickles &amp; mustards (small 16.00 GBP | large 32.00 GBP); delicious! I loved the mustard as well as the terrines very much!<br>- main: <br>&#34;MOULES À LA CRÈME&#34;: steamed mussels, white wine, leeks, celery, parsley, crème fraîche (16.00 GBP); extraordinary; best mussels we had for a long time<br>&#34;RATATOUILLE&#34; with goat cheese and crisp bread; loved it!<br><br>Conclusion: Expensive, however great atmosphere, delicious food, great service! Highly recommended! Only minus: seating toooooo narrow!",
