"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/aMgi4Np5ZTfW-1oo0HAz2g/l.jpg",
"rating":"4.0",
"reviewcomment":"Remember the episode of Seinfeld - yes, I&#39;m dating myself - where they&#39;re waiting for a table in a Chinese restaurant...well, it&#39;s sort of like that. The restaurant is small with mostly 8 person round tables, so it&#39;s also jammed packed. They have all the BBQ&#39;d ducks in the front window and watching them debone a duck is amazing - I&#39;m talking 30 seconds start to finish with a huge cleaver. It&#39;s worth the price of admission. The food is also excellent, albeit with spotty service that requires you to be a bit more engaged in making things happen. Don&#39;t expect a friendly welcome and how do you do - it&#39;s all business with a &#39;you ready to order&#39;, but that&#39;s what makes it fun. Oh yeah, don&#39;t expect a quiet dinner for two - it&#39;s better for a larger group that&#39;s in the mood for fun. <br><br>As for recommendations, you can&#39;t come to a place that can filet an entire duck in seconds without having any. It&#39;s worth it. I also love the crispy pork belly and the spare ribs are great. I also enjoyed the bok choy and the hot and sour soup with a bit of English flair - peas and tiny shrimp. Overall, everything looks good here and I look forward to my next visit.",
