"ogimage":"http://s3-media4.fl.yelpcdn.com/bphoto/xLO4x8SGb3LyQQRsps5HFg/l.jpg",
"rating":"4.0",
"reviewcomment":"I admit. I resisted. I&#39;ve had Lebanese food elsewhere in London. I&#39;ve had Lebanese food in Lebanon. But Yalla Yalla really exceeded all expectations. <br><br>The two of us shared a bunch of dishes. The signature chicken livers was my least favourite. Tasty but the sauce needed to be more prominent. My friend had had them twice before and said the sauce was more reduced and coated the liver better the first time. <br><br>Otherwise, the other dishes were spot on. <br><br>The fattoush salad was perked up with crunchy bits of something or other (I suspect day old dried pieces of pita). <br><br>The chicken wings were perfectly fried. Skin was not rubbery but crispy and flavourful. <br><br>We shared the kafta main which was the best I&#39;ve had in London. Very nicely spiced and perfectly grilled. <br><br>Overall, a very tasty and flavourful meal. We shared a lovely bottle of Lebanese red wine. Definitely would recommend if you are in th area. Get here early (or very late!). There is always a queue for good reason.",
