"reviewcomment":"My husband and I were walking around the neighborhood on a Saturday afternoon trying to figure out what to eat for lunch.  We walked past Patty and Bun and saw there was no queue and took advantage of the situation because there&#39;s ALWAYS a queue.<br><br>Food: We ordered the &#34;Ari Gold Cheeseburger&#34; which is their traditional burger and two orders of chips.  I&#39;m looking forward to trying their other burgers.  One awesome surprise was their hot sauce.  It was a smokey hot sauce which was delish!<br><br>Drinks: We ordered two soft drinks.<br><br>Price: For two people we paid 25.85 GBP.<br><br>Ambiance: The place is small (31 seats) which is why there&#39;s always a queue outside.  The tables/chairs are tight, but once you get seated you don&#39;t care because the smells of the burger and fries are to die for.  The restaurant is lively, everyone is young and the music is good.<br><br>Service: The service was great.  The host was super friendly and our server was very nice.  The food comes out pretty quickly.<br><br>Would I go back?  Definitely!  It&#39;s on the favorites list in the neighborhood.  Not sure how long I would queue for it, but if you&#39;re walking by and there&#39;s no queue definitely see it as a sign from the universe that you must eat a burger!",
