"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ImdiZHSb_Od5AW33N61KQQ/l.jpg",
"rating":"3.0",
"reviewcomment":"My dining partner and I come here on average once a month for the pancakes. If you come when the place isn&#39;t overly crowded, the pancakes are top notch, as is everything else we&#39;ve tried here (all breakfasty foods, I will admit). When it&#39;s very busy, though, the food is a bit hit and miss. <br><br>The last time we were here, I got toasted corn bread with smashed avocado with chili peppers and two poached eggs on top. And a few bites of his pancakes. It was absolutely delicious, and will likely be my new staple - when I don&#39;t have those pancakes. <br><br>Speaking of the pancakes, it&#39;s the plain buttermilk pancakes that are the best. I got blueberry pancakes once and was disappointed to see that it&#39;s just the plain pancakes, served with a blueberry sauce instead of maple syrup. When I think blueberry pancakes, I think blueberries in the batter - but maybe that&#39;s just me?",
