"rating":"3.5",
"reviewcomment":"Great place if you&#39;re in Holborn and want pancakes. The location is great - close to Holborn station and not a very far walk from Oxford Street or the Bloomsbury campuses (if you&#39;re a student like me). <br><br>I&#39;ve come here a couple times to try different flavours because they have such a huge menu! If you are looking for American style fluffy pancakes then get the Butterscotch ones. They come in five regular sized stacked pancakes, topped with powered sugar and whatever topping you chose. The chocolate chip pancakes I ordered were super sweet and very filling! <br><br>The other pancakes are more similar to a crepe, thin and easily folded. They are seriously gigantic and you need to be very hungry to finish the whole thing! But a bonus to these is the lovely dutch painted plate they serve it on :) <br><br>Service was fine, nothing spectacular but not too bad. The pancakes are definitely the main reason I come here, so many options and delicious every time!",
