"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/h3OLzu89dCfAs-_3sICFBg/l.jpg",
"rating":"3.5",
"reviewcomment":"One of the best places in Shoreditch to go if you&#39;re looking for a delicious little Sunday brunch. Make sure to get there early though because they stop serving breakfast around noon and the queue is quite long (but very well worth it).<br><br>We ordered a latte, cappuccino, muesli with yogurt and berry compote and cheesy focaccia with onions. Absolutely delicious. It hits the spot if you&#39;re looking for a divine way to start off your day.<br><br>The atmosphere is wonderful as well. We sat at a wooden communal table and were surrounded by lots of lovely people who were all catching up and looking for a delicious brunch just as we were.<br><br>On our way out, we couldn&#39;t help but grab a loaf of bread to-go. I highly recommend doing so! Nothing beats the aroma of freshly baked bread.<br><br>I highly recommend popping by!",
