"reviewcomment":"My first time to this part of London and Bermondsey Street is such a cute area. This restaurant is fairly far down along the road that comes from London Bridge, like a good 15 minute walk, but I passed a lot of cool restaurants, bars, and shops along the way.<br><br>We came for brunch and it didn&#39;t seem to be that crowded, with some empty tables around us at peak time. I ordered the lobster benedict, which was a menu item I hadn&#39;t seen before, and it was delicious. I don&#39;t know how much food they give you with the small portion, but the large one was a good amount and I would definitely have been disappointed with less.<br><br>My friends had the buttermilk and buckwheat pancakes, which looked good but fairly standard. I don&#39;t think they&#39;re serving anything mindblowing in terms of brunch food innovation, but the food was very good and the decor is fantastic (and there&#39;s no queue).",
