"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/MokqN9yyjAwZi_jk0rZ5sw/l.jpg",
"rating":"3.5",
"reviewcomment":"Another really hyped place. Specializing in Rum based drinks and the asian-latin fusion food. Portions are very large here when compared to other places. Plus it&#39;s the restaurant in the hotel and it was only a matter of time before getting a meal here.<br><br>Started out with two dishes for the group: <br><br>SCOTTISH SALMON AND SALTED AVOCADO HELADO - nice and well balanced. A great starter to have.<br><br>SPICY HAMACHI AND PLANTAIN THREADS - plantains were not as crunchy as I would have preferred as it would have been a great texture to have with the hamachi.<br><br>My main was the CUBAN BBQ CHICKEN which was recommended from our waitress. It was a solid dish. Chicken was moist and bbq of the tamarind had nice flavor. Like I mentioned above, huge portions here and this is was huge. Definitely a good recommend. Props to her.<br><br>Desserts equally are huge. Mexican doughnuts were good with butterscotch filling and sauce on the side. The Cuban Opera cake was also quite good, but you must be a chocolate fan for it. <br><br>Overall a good spot but one of the more pricey places around. Weekdays are days when you can walk in and get a table. Weekend, then you&#39;ll need to plan ahead and reserve.",
