"reviewcomment":"If you are looking for a nice dinner with friends or family, this is a beautiful place.  The building and interior are very stylish and gorgeous.  It felt like an old house!<br><br>I ordered a &#34;Tesoro&#34; cocktail (Limoncello, prosecco and mint).  It was very lemony, sweet and refreshing.  The Beef Bourguignon was amazing.  Delicious, tender and cooked to perfection.  The mashed potatoes on the side were also smooth and very flavourful.  The table ordered a Gavi wine with our meal and it was wonderful.<br><br>I would love to come back again.  Also, they do offer a Tastecard discount from monday-thursday! (Must be called in for reservation though!)",
