"reviewcomment":"This place is solid.  Situated on a beautiful street in Primrose Hill it is a deceptively large restaurant but it never feels big because of its design.<br>This is a place to sink in, relax and enjoy a leisurely meal.<br>I recommend the meze--we had a few--an aubergine salad, taramasala which was amazing and a greek sausage that came with an amazing tomato based sauce with cinnamon.  <br>My lamb main was good although next time I&#39;d try the grilled offering.<br>The service was great--good sense of humor Greek men who are professional waiters.<br>I love the authenticity, family-style vibe that this restaurant offers coupled with good food.  <br>A fan.",
