"reviewcomment":"Summary: <br><br>+Great food <br>+Nice and modern ambience <br>+Best among other competitors in the area <br>+Shrimp summer roll: Fresh<br>+Beef pho: Yummy<br><br>Overall:<br>I paid a visit to one of my favourite establishments in East London. Viet Grill is an unassuming gem of Vietnamese restaurant on Hackney Street. Surrounded by five or so other Vietnamese restaurants on the same side of the street, Viet Grill stands out in both food and ambience. <br><br>I went in at 11:30 for an early lunch before a meeting in that area of London to catch them just opening the restaurant. <br>I was shown into a window seat in the well-lit roomy dining space that is decorated with modern wooden floor. From a quick glance, this place could be easily mistaken to a nice French café apart from the large paintings of bamboo in warm pastel colours that decorates the walls and lively discussions in what sounds like Vietnamese from the kitchen. <br><br>The staffs were all amiable and helpful. <br>Since it was my first Vietnamese meal in a long time, I decided to go with the classics. Beef pho for the main and prawn summer rolls as a side. <br>The waitress pointed out that those dishes happen to be included in the lunch combo, so I could have them for only £10. Nice. <br><br>The service was very quick. The summer rolls were served within five minutes. <br>In another 5 minutes or so, I had my bowl of pho noodle. This suggests they had a stack of summer rolls ready before the busy lunchtime war. They clearly know what they are doing. I like that. <br><br>Food:<br>The summer roll was packed with fresh salad, rice vermicelli and thin slices of shrimps all wrapped tightly in a soft rice paper. <br>As I bite into one of the rolls, the flavour of mint and coriander filled my mouth. I liked the way they sliced the shrimps into smaller pieces so they don&#39;t make big lumps inside the wrap. The peanut sauce on the side has a typical South East Asian mix of rich sweetness and spiciness. <br><br>The beef pho was a true delight.  The beef-based broth was rich and yet not too fatty. The sweetness from roasted onion and subtle flavour of coriander adds another dimension to the taste of broth. <br>As in any Vietnamese restaurant, the pho was served with a set of herbs that enhances the taste of broth. There are variations to this flavour booster kit but it usually consists of thai basil, bean sprouts, a slice of lemon or lime and sometimes chopped red chilli peppers. I like to have first couple of sips without the boosters and appreciate the richness of naked broth. As usual, I threw in the herbs and lemon juice half way into the meal. The change in the broth is both pleasant and dramatic. The once sweet broth now has edgy sourness and bitterness to it. <br>I always find the flat rice noodle hard to eat without making a mess. But I think it&#39;s more about my clumsy chopstick skills than the dish itself.",
