"reviewcomment":"Consistently good Japanese fare in a stealthy wrapper... Taking a walk down Old Compton Street it&#39;s easy to miss the hidden gem that is Taro! Even then first impressions don&#39;t count decor wise  as the place is always busy with those in the know about the tasty array of Japanese goodness within.<br><br>Anywhere this central that can feed you two stonking great bento boxes and beers for under £40 for two gets a lot of love in my books!<br><br>I am a creature of habit and their Ebi Fry bento is something to behold: four mouthwatering fried king prawns in Panko drizzled with a thick sweet sauce, salmon &amp; tuna sashimi, crab stick and avocado rolls, edamame &amp; bean sprouts plus a bowl of rice and a bowl of miso... <br><br>Not finished yet: for under £15!! Throw that down your neck with an Asahi or Ramune retrospective lemonade ;) and you&#39;re in Heaven!<br><br>The staff are attentive but not overpowering in my experience (go atleast twice a month!)<br><br>Give it a bash...",
