"reviewcomment":"Cubana is a mixture of a bar and restaurant I think it succeeds on both ends. The cocktail menu is quite extensive and all of them are a good deal through the happy hour. I do get happy when I drink cocktails, I don&#39;t know why :)<br>I loved the Ensalada Fresca - that&#39;s a vegetarian salad and comes as a starter but don&#39;t fill up on it as it is quite big and you wouldn&#39;t get to try the goodness that comes later. They also have all sorts of deals through lunchtime. That being said and topped with the high quality of the food itself adds up for a brilliant choice for a lunch spot. <br><br>If you&#39;re in the area you should definitely try it, despite the lack of imagination regarding the design of Cubana - it seems quite unwelcoming to me.",
