"rating":"4.0",
"reviewcomment":"Came here with relatives last September 2013 during my first visit to London. I must say, what a surprise. Upon arrival, we were seated promptly, and the staff was friendly. There were 4 of us dining together and we ended up ordering a good amount of food.<br><br>We ordered a variety of dishes...the food came out in a timely manner. I had a taste of the seafood soup, peking duck, pork buns, seafood fried noodles, and a variety of dim sum. It was all delicious!<br><br>There were only a few other groups dining among us. The atmosphere was very relaxed and enjoyable. This was a great place to go with my family and travel buddy!",
