"rating":"3.5",
"reviewcomment":"Thanks Yelp, another great find in London. We made reservation with TopTable only to find that it was for the ritzier upstairs. No worries, they let us sit in the more casual pub down stairs by the bar. Awesome service, very un-pub like in that way. Three of us shared the fish and chips. We loved the fish and the mushy peas, chips were average. But then on a whim we shared one order of their sticky toffee pudding! One was not enough, it was the best I ever had. Many puddings are way to sweet to eat more than a bite. This sticky pudding was perfectly addictive. I would return for this alone!",
