"rating":"3.5",
"reviewcomment":"We finally managed to go here. I had been wanting to go to the Red Dog Saloon for a while now and it completely delivered on my expectations. <br><br>First of all, they take reservations. Given the fact this is a famous burger-place, that&#39;s definitely a plus-point, compared to all other burger-places here in London. <br><br>And you get exactly what you&#39;re expecting: great American-style wings (we took first the combination platter and then went for a second round of the spicy mustard ones), pitchers of beer and fatty juicy burgers. I had the standard bacon cheeseburger, topped with two extra patties, making it 4 layers of meat, bacon and cheese it total. This was heaven dripping down my fingers. The whole thing staying relatively together while eating.<br><br>I do have to say I expected the burger to be a little bit bigger (given that I made it almost double it standard size). Maybe it&#39;s because I was already a bit drunk, but I had no problem finishing it (having had some wings beforehand and a side-order of fries to share as well) while I was expecting to have some heart-failure afterwards, which wasn&#39;t the case.<br><br>But in the end, a great evening with friends and some great American-styled food.",
