"rating":"3.5",
"reviewcomment":"I&#39;ve been brought here on multiple occasions by friends and have had amazing food each time. It is really best for groups so you can share dishes and try lots of different things. I would definitely recommend the shrimp dumplings dim sum but I think every dish is delicious and true to it&#39;s name. We have never ordered something that turned out to be very different i.e. not crispy, not large enough, too much fruit/veg rather than meat. <br><br>I was very surprised at some of the previous reviews (save for the review by Sarah T. just below mine) as I&#39;ve always experienced wonderful food and wonderful service when I come here but perhaps they have improved in the last couple of years. I particularly want to highlight the staff who are so patient. They were very nice to my friends who aren&#39;t used to dim sum and very helpful when we asked about various ingredients. They have also been respectful about my slight fish allergy. <br><br>I prefer this restaurant over all the others in Chinatown. It may be a bit more expensive but it&#39;s worth it.",
