"rating":"4.0",
"reviewcomment":"If you can fall in love with a restaurant than I fell in love with Caravan. <br><br>Ok. fine. FINE. I fell in love with the handsome hipster baristas, high ceilings, exposed brickwork and delectable pastries. How have I never been here? It&#39;s like the Mothership. <br><br>Basically this place is a middle class yuppie paradise. Hip, young things swigging coffee, talking about their polenta brunch choice and spending £4.50 on an orange juice. <br><br>Yes, we waited. We waited over half an hour, but it was brunch so what&#39;s the rush? <br><br>We ordered a sweet muffin, which was kinda of like a cupcake-muffin, with frosting. Sourdough toast with avocado and sausage and a chorizo bake. Everything was good but next time I definitely want to try the waffles! I didn&#39;t find it over priced but maybe if I come back for dinner (yes, obviously I will) then I can try their small plates.",
