"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/YOs1VxAEA7w6UovI3KOagA/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;ve enjoyed all of the burgers within the burger triangle of Marylebone.  Even though Patty and Bun and Meatliquor have delicious burgers, Tommi&#39;s is my favourite.  The menu is simple, the process is easy to get a burger by ordering at the counter, the music is fun, and the burger and fries are just damn good.  There&#39;s nothing fancy about the burger and fries.  No secret sauce or added items.  They&#39;re simple and original - just the way a burger and fries should be.  I usually order the &#34;Offer of the Century&#34; which includes burger, fries and a soft drink for 9.90 GBP which is a great deal for London.<br><br>Another thing I love about Tommi&#39;s is that it&#39;s self serve with all of the awesome extras.  They have pickles, jalapeños, mayo, mustards, ketchups, all kinds of hot sauces including sriracha and steak sauce. You name it - they have it.  This way you can make your burger to your liking.<br><br>Keep in mind that it can get pretty busy at peak times for lunch and dinner so go early if you want to sit and enjoy your burger.<br><br>Would I go back?  Hells YES!  It&#39;s on the favorites list.",
