"ogimage":"http://s3-media2.fl.yelpcdn.com/bphoto/xAEZhDL48S3mRacE_2N5tg/l.jpg",
"rating":"4.0",
"reviewcomment":"Nice little local pub in Islington that is loved by the locals and cozy.  <br><br>Full of windows, spacious and well lit, this is a comfy gastropub that feels very little like a bar and a lot more like a restaurant and is frequented by mothers with strollers, local chaps out for a pint and vegetarian and sustainable food loving folks from the neighborhood.  Our crew had a decent risotto, a gigantic and very meat forward bowl of spaghetti bolognase (heard it was delicious), a plowman&#39;s lunch with veg, cheese and a big piece of roast pork, and someone had the gall to order just a large bowl of soup, which came with a bowl of bread. This is a solid, upscale neighborhood pub.<br><br>What really seemed odd in a pub, was to be charged shy of three pounds for the bottle of tap water they placed on our table with four empty glasses.  A crew of regular patrons were surprised and bristled when the bill came, mumbling it was not great hospitality, and I suppose I can see their point.",
