"rating":"4.0",
"reviewcomment":"I love the atmosphere of this place with the rustic wooden furniture, antler light fixtures and old school light bulbs. Not to mention the cozy fireplace. This place is very spacious with dinning tables &amp; bars located upstairs and down. <br><br>The menu has a delicious farm to table menu. I highly recommend the charcuterie plate for an appetizer and the Suffolk Chicken for dinner. The sauces that accompany the dishes have remarkable flavor. I am torn between the classic gravy and the red wine reduction sauces as my favorite.   <br><br>They also have a great selection of cocktails, wine, beer, and whiskey. My recommendations are the mint julep or the mojito if your seeking something fresh. Also, let&#39;s be honest one can&#39;t go wrong with a good bourbon or rum cocktail. <br><br>I recommend making reservations in advance. They get packed quickly in the evening between 6-8pm. <br><br>Of the two meals I have had there, I am yet to have room for dessert so stay tuned for an update. <br><br>Cheers!",
