"categorystrlist":"Bars,         Music Venues,         British",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/2anQyFX8zk4e-my1-Z0K2A/l.jpg",
"rating":"3.5",
"reviewcomment":"A few weeks ago I went to the Old Queens Head in Islington for a gig. I decided to go there early to have something for dinner.<br><br>When I arrived, the pub was quite full - this seems to be a popular place among the locals. But I was lucky enough to find a place at a table. For the food, I ordered the sliders and fries. While the fries were good, but not extraordinary, the sliders were excellent. Just a bit small, I should probably have ordered six instead of three. There are three different sliders available with one veggie option. And I must admit, that I quite enjoyed the veggie slider. <br><br>Later I went upstairs to the gig. The room offers lots of comfy places and service throughout the gig - good if you are hungry or thirsty, a bit annoying if you are there mainly for the music. But overall it was fine. <br><br>The lineup was quite extensive, raging from singer songwriter artists with a voice and a guitar to complete bands. The sound was fine and some of the artists were really good. The Old Queens Head is definitely a place I will keep in mind when searching for gigs in the future.",
