"rating":"3.5",
"reviewcomment":"If you REALLY want some Mexican food, then La Perla isn&#39;t half bad. But I usually choose to not eat Mexican food in London, as I find it to be disappointing. <br><br>I went with a large group for a friend&#39;s birthday. The place has a fun vibe to it and an interesting ambience. However, we were disappointed that there were no sombreros for the birthday girl to wear. Bummer. <br><br>We had nachos, and they were very good, with lots of jalapeños and cheese. The salsa was surprisingly spicy and delicious, along with the thick tortilla chips. The guacamole needed some lime, margaritas needed some extra tequila. I had the Chicken Verde enchiladas, and they were pretty good.<br><br>If there was an option for a 3.5 star rating, I would give it to La Perla. Ultimately, I&#39;m rounding up because I think it&#39;s been the best Mexican food I&#39;ve had so far in London. But really, that isn&#39;t saying much.",
