"categorystrlist":"Bowling Alleys,         American,         Karaoke",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/jC32xe0HiK_egtbJ7MwdCA/l.jpg",
"rating":"4.0",
"reviewcomment":"I don&#39;t actually believe that anyone bowls here. I&#39;ve seen bowling alleys, but I&#39;ve never seen them in use. I think the staff just stand behind the counter and tell people they&#39;re fully booked, and can&#39;t fit anyone else in.<br><br>Okay, I jest. But if you do want to bowl here, you&#39;re going to have to book well in advance.<br><br>I came here with a few friends for a relaxing evening in the restaurant/diner area. If you are meeting people here, for some reason it can be really hard to identify them. I thought it was just me, but every member of our party circled the entire venue a few times before having to wander back outside (there&#39;s barely any phone signal in there) to try and contact us.<br><br>One settled, we were lucky enough to have a friendly and funny waitress who kept the drinks flowing for us. Try the &#39;Zombie&#39; cocktail - it&#39;s pretty lethal, and comes blazing. Like, actually on fire.<br><br>I opted for the fried chicken basket and sweet potato fries, which was pretty good. The chicken was very tender and the spice was done right. Though not a place to go for an amazing culinary experience, it is good for a fun night out with friends.",
