"rating":"3.5",
"reviewcomment":"Masala Zone is an Indian restaurant with several locations around London. I visited the Earls Court location and really enjoyed the experience. The atmosphere of this place made me feel like I was back in India with the dark setting and the aroma from the kitchen.   <br><br>We ordered a variety of starters including the Sev Puri and Dahi Puri.  They were all delicious and I could have eaten it all by myself! For my main course, I chose the thali which is a traditional Indian platter loaded with little bowls of various treats.  Everything I tried was good.  <br><br>The most amusing thing for me about this place is fact that they had Masala Coke.  I first had a Masala Coke in Delhi, India.  I remember tasting this creation on the streets of Delhi thinking that my friends had pulled a joke on me.  It was quite possibly the worst thing I&#39;d ever tasted.  So when I saw this rancid thing on the menu here at Masala Zone, I realized that my friends back in India had not pulled a joke on me.  I had to try it again here at Masala Zone and while it still wasn&#39;t very good, it was a lot better than the one I had back in Delhi.  <br><br>4 stars for Masala Coke and making me feel like I was back in India.",
