"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/cOJOANM1iEHgvoBcasO8Lg/l.jpg",
"rating":"3.5",
"reviewcomment":"In short: tasty food, pretty restaurant, attentive service...but missing the &#34;x factor&#34; for a 5th star.<br><br>We were here for Sunday lunch, when the restaurant was surprisingly empty.   I was initially disappointed that there was no brunch menu; it was unclear why (other reviews seem to indicate there used to be brunch available) and I think they&#39;re missing a key market opportunity.  Oh well, the rest of the menu looked tasty anyway!<br><br>And tasty it was.  I had the mussels and fries while my friends both got Sunday roasts.  We all kept raving about the food -- it was fresh and cooked to perfection.  It was nothing overly unique, but it didn&#39;t need to be and wasn&#39;t trying for that approach.<br><br>Likewise, the atmosphere was simple, bright and classy, and the service was attentive and gracious.  Nothing about this place was trying to be trendy; it was clearly meant to be &#34;just&#34; a delicious meal in a nice setting.  <br><br>The whole effect came across as enjoyable but a tad bit boring to this twenty-something.  It would be a great choice for lunch with mom or a business meal, but perhaps worth trying somewhere else for a lively &#34;guess what I did last night&#34; Sunday brunch.<br><br>Side note: Based on some other reviews, it seems like the place might be a lot livelier in the evening for drinks -- I would definitely give that a try, especially if the cocktails are as good as the food was!",
