"rating":"4.0",
"reviewcomment":"As I walked past I saw a billboard advertising half price food. After also been recommended by a friend there was no doubt but to go in and check it out.<br><br>Starters and desserts for £2.45 and mains for £4.95, price was definitely a good start.  I ordered calamari to start, followed by the special of the day lamb shank. <br><br>Both dishes were very tasty and of a good size. The lamb was served in juice with veg, the meat came of bone with ease and was very tasty. I couldn&#39;t manage a dessert but my husband ordered the chocolate pecan tart and said it was amazing.<br><br>The service was attentive and fast and the atmosphere was relaxed. The drinks were reasonably priced.  I would recommend coming to anyone.",
