"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/TrPIA0mt8trVBcxyYFwMGg/l.jpg",
"rating":"3.5",
"reviewcomment":"Planet Hollywood is located right next to the Cineworld at Haymarket, and so it is a somewhat regular place for me to go to if I fancy a drink before a movie (Cineworld is great in many other respects, but it doesn&#39;t serve a good selection of alcohols). <br>The place is not too expensive, at least by the standards of the location. But it&#39;s quite glitzy. The bar area has a number of television sets which continuously show some sports or musical programmes or wish customers, not all of them kids, on their birthdays. <br>They have quite a good and extensive cocktail menu. They make a really good &#34;Long Island Iced Tea&#34;. They serve the drink after mixing the Coke well with the alcohol, just the way I like it. <br>I haven&#39;t eaten at Planet Hollywood very often, but there is one dish there that I love. It&#39;s their world famous chicken crunch. The four pieces of fried chicken breast are served with a fantastic creole mustard sauce and carrots. The coating of the chicken is slightly sweet, which goes very well with the mustard. I order this quite frequently with my drink. <br>The bartenders here, unlike most in London, do like to talk and they also enjoy their conversations with customers, at least with the interesting ones like me ;) I have many reasons to keep returning.",
