"rating":"4.0",
"reviewcomment":"fantastic restaurant. worth every penny you spend here. the interior really makes you say &#39;Wow&#39;! you don&#39;t see much when you walk in, but as you enter you get that richness vibe in it. There&#39;s even a Waterfall inside the restaurant.<br>It could get better in their service. I found it very very slow for a such a classy restaurant, sometimes its even unbearable. I ordered for a glass of wine, and this guys runs with this glass full of wine several reminders later, with things dripping all over. First of all, i wouldn&#39;t even touch the glass, but hold it by the stem..uhm uhm..not here! which is a put off...<br><br>Food was excellent, it could be classified as one of the Finest Indian restaurants as close to home I could get. Had tears in my eyes after tasting their &#39;Hyderabadi Dum Briyani&#39;, and Goa&#39;n Fish curry. Portions are small, so order for yourself and others. Can&#39;t share....you will not share :)...as it is so yummy. <br><br>Very pricey, and they add their service charge of 12.5% to every bill also...so watch out before you pay a tip. <br>We were given a table around a large group with a family of kids, hence it was a bit too noisy, with kids playing around you, but thats not their fault i guess!! Would go back for sure.!",
