"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/F_LVVdzbg1wfv7OrS3iwOA/l.jpg",
"rating":"3.0",
"reviewcomment":"Me and a few friends went to Maxwells two weeks ago as a friend of ours and her boyfriend were visiting from Brussels. There was seven of us on a Friday night. Where to go for dinner? We were lucky to be able to get into Maxwells with just a little wait. About 15 minutes and we were seated and got menus. Since we had already gotten drinks from the bar while waiting the waiter did not have to get us any. He seemed a little disappointed when we ordered only food.<br><br>The food was good, some had Mexican food while a friend of mine and me had a tranditional burger. At GBP 10.95 for a burger I was hoping for a good one. Luckily, it was and it certainly was enough to deal with my appetite.<br><br>We had a few more drinks and when paying, we added a little tip (to cover the service charge - I think service charge is inappropriate for a small group but hey, instead of a tip ...).<br><br>All in all, good food, not too long wait even on a Friday ...",
