"reviewcomment":"This is a great place for a casual dinner before a night out on the town. Compared to a few other Vietnamese places on Kingsland road, Tay Do can be a tad bit more costly (i.e. £1 more for pho). I favour Song Que for it&#39;s &#39;Special&#39; pho which includes tripe and tendon for the adventurous people. Nevertheless, Tay Do does the trick. The bowls of noodle soup are generous and the best part, it&#39;s BYOB. If you like a few beverages, the amount you save on BYOB with no corkage more than makes up for any slight comparisons in price :) <br><br>There&#39;s a reason why there are two locations on Kingsland road! Worth a stop by to either. No queue when I popped by just before 7pm on a Friday night but within the hour, the place was packed!",
