"rating":"4.0",
"reviewcomment":"This is a haven of nostalgia and decadence. The architecture, furnishings, tiling, and lighting alone are enough to secure 5 stars in my opinion. Entering the building is like walking back to the 1930s, but not in a way that feels contrived. The Art Deco/beaux arts interior is simply stunning, and the atmosphere is exciting as a result.<br>We ate in the Brasserie Zedel, but glimpsed into the Bar Americain and the cabaret club and both complimented the overall vibe greatly. <br>The food was incredible, and met the standard of real French cuisine. I chose the Choucroute de la Mer, which consisted of a very generous serving of a variety of seafood (salmon,haddock,mussels,prawns) served on a bed of sweet cabbage in a light creamy sauce. I cannot recommend it enough.",
