"reviewcomment":"So good I ate them twice! Amazing light fluffy American pancakes; I had the blueberry pancakes to start,  we arrived quite early so service was instant! <br><br>You get a huge jug of syrup and butter if thats your fancy and 4 well sized pancakes,  a sliced strawberry and piece of orange on the side! They were lightly dusted with icing sugar and u added a nice helping of syrup!  When looking at them they look thick and stodgy but they are incredibly light abd fluff with a nice amount of fruit in....spot on, I quickly demolished 4, I have a good appetite so promptly ordered a quick stack of banana. ....ecen better this time, the banana had caramelized slightly!  <br><br>I must add 4 is enough for most but I have an incredibly sweet tooth and eat 4000 calories a day! This was a treat so went all out with 2 stacks! <br><br>Not cheap in doing so and they automatically added 12.5% to the bill for 2 of us....which im not against tipping but id like to do so at my own will.<br>Again not a cheap diner but the taste was there to back it up. The place is a little shabby and too American to seem authentic but we were both happy with our food &amp; drinks! <br><br>Ill be back when I next have a pancake craving!",
