"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/j-MkcVIQUt-cjc15G5FMjg/l.jpg",
"rating":"4.0",
"reviewcomment":"Came on a Thursday with reservations. Service was great - which is a deal breaker for a restaurant in this price range. Ordered a bottle of bubbly that was kept chilled through out our meal.  We ordered a few things, however the standout dishes were the pork belly and jamon croquettes.  I also appreciated the fennel salad. In fact we ordered a second plate of croquettes because it was that good. No dessert was ordered since we stuffed ourselves with tapas.  Small portions and surprisingly decently priced, but not necessarily on the low side. <br><br>The only negative was that the food can out too quickly and would have preferred a slightly slower pace. <br><br>The restaurant is in the lower level, so no natural light or views of outside.  Despite this, the restaurant feels bright enough and not claustrophobic. <br><br>I would return, but for a special dinner.  Total came to about £125 for about 7 plates and a bottle of bubbly for two of us.  Applying our lousy dollar conversion rate, it&#39;s about 200 bucks.  Not bad considering we ordered whatever we wanted and walked away feeling very satisfied. <br><br>A special call out for the host who was very kind and welcoming upon our entry and departure.",
