"reviewcomment":"This place is great. Great fresh sushi and sashimi for a reasonable price, udon noodles, traditional Japanese chicken &amp; beef dishes. We&#39;ve been 3 times and mostly just binge on sushi and sashimi platters, but definitely try some other dishes as well. They serve Ashai on draft (so much better and colder than on bottle) and have a few sakes as well.<br><br>In my experience, the service is nothing to complain about and always has been great.<br><br>Another great thing about this place is the venue. Hosted in an old pub, they barely changed the setting and so it&#39;s something different compared to most Asian restaurants.<br><br>If you crave sushi and don&#39;t want to spend a fortune in London; this is definitely the place to go!",
