"reviewcomment":"A straight shot walk from Marble Arch, I highly recommend making a reservation (they&#39;re really particular about that) at this tiny little Burmese restaurant. While I wouldn&#39;t say this a place that inspires much in terms of ambiance their food is to die for. To be clear, I wouldn&#39;t criticize them for just having a clean mom and pop space, but just keep your expectations simple. <br><br>I went with the coconut chicken curry noodle soup (with a little bit of extra heat at request) and the cucumber/papaya salad as recommended on Yelp. ALL THE YES. I&#39;ve never had Burmese food before, but I am totally sold. I wasn&#39;t expecting the complexity of flavors from a curry noodle soup or an appetizer salad, but they were both quite nuanced dishes. <br><br>Definitely will make the effort to trek out here again.",
