"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ZscKYrCl1QbNu5F3J-GQrg/l.jpg",
"rating":"4.5",
"reviewcomment":"Was lucky enough to go here yesterday for lunch. Hidden away, this place is a secret from the start, and a real treat.<br><br>Basic decoration, with beautiful art and a busy service, I warmed to it from the moment I stepped in. Surprising to see so many suits though ;)<br><br>I had a caramelised onion &amp; goat&#39;s cheese tart to start, which was absolutely divine. Just thinking about it is making my mouth water actually. I&#39;d go back just for that. Looking around, the pork rillettes also look really nice - but I always have that, so thought I&#39;d mix it up.<br><br>For main I had the roast duck special, served perfectly pink with red cabbage, fried and dressed green salad. Utterly lovely.<br><br>Left feeling satisfied but not overfed. Will definitely be back. <br><br>Service is exactly quick though, so maybe good for an afternoon or an evening.",
