"rating":"3.0",
"reviewcomment":"Came here one Saturday visiting Spitalfields for the first time as part of my weeklong trip with my husband to London last summer.  This is one of those things where I have to try brunch in a local place.  I usually try to stay away from chains even when I am in a foreign country but I saw decent reviews for this place and was the only place I can find that is affordable with the limited knowledge that I have of London.<br><br>Because this is such a late review, I can&#39;t remember what me and my husband had so I&#39;m going to guess I had the Full Brunch Plate.  The one thing that really stuck out for me about the dish is the sausage.  It was very very delicious.<br><br>Price-wise I think is pretty reasonable for brunch.  I live in the East coast of the United States and the value is about the same, albeit a bit more expensive in London but this is expected.",
