"rating":"3.5",
"reviewcomment":"The epic combo of an incredible Champagne list from Sandia Chang and ultimate #foodporn hotdogs from her husband James!! I absolutely love this place!<br><br>I have only been here once so far after having a few too many cocktails and looking for some scrumptious food to fill the belly! I had the Reuben beef Hot dog(with sauerkraut, Russian Dressing and melted swiss cheese £7) and sweet potato fries (£3.50). I can honestly say this is the best hot dog I have ever had, definitely trumps any of the trendy burger chains too... Plus the &#34;sweet potato&#34; fries &amp; champagne combo make you feel like you are being healthy &amp; classy at the same time as eating a hotdog haha. :)<br><br>Really chillaxed quirky venue with cute features like the collage on the bathroom walls of restaurant menus that Sandia &amp; James have dined at. Great place to start the night (or end it) in Fitzrovia, London<br><br>P.s I here the &#34;Kitchen Table&#34; hidden through the back of Bubbledogs has a highly recommended tasting menu that I am still to try..",
