"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/mljoby1dN9gvspRZlTH2dA/l.jpg",
"rating":"3.5",
"reviewcomment":"I decided to try this place again. The more London gentrifies and the fancier it becomes, the more I want parts of its crumbled, bedraggled past to remain and keep it all a bit real. Nothing has changed inside Fryer&#39;s Delight in the two and a half years since I set foot in here. Which is no surprise as it might not have changed since before I was born. The only thing that needed to change for me to like this place a lot was the freshness of the fish. And that is one thing that has, thankfully, changed since my last visit.  The fish was good enough to bump up my previous rating to 4 whole stars. I would have left skipping, if I hadn&#39;t been so full I could barely walk. <br><br>Remember this is a &#34;chippy&#34; and the food comes with no frills. However, it is good enough not to need any. And stepping inside is like stepping back in time. There aren&#39;t many places left you can buy time travel AND good fish for a tenner.",
