"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/iOBJK47XGwkQZ4fnQ2XhgQ/l.jpg",
"rating":"4.0",
"reviewcomment":"**FANFARE**<br><br>My 100th review!! I was saving it for somewhere I really liked.<br><br>I originally was going to give The Counter Cafe 4 stars but something gave it that final star. More on that later.<br><br>Firstly, a 5-7 min walk from Hackney Wick, The CC is right on the canal and some of the tables are on a ....I don&#39;t know what the official name is, but a &#39;floaty bit&#39; *facepalm* outside with plenty of barges moored nearby, so whenever someone steps on or off it kinda wobbles a bit. My mum would never sit here &#39;Im scared Anoop, we&#39;re going to fall in!&#34;. Whatevs, Mum.<br>Anyway, fk&#39;it.<br>I had scrambled eggs with smoked salmon and it was sooooo good. Really light but very flavourful - hurrah for organic food! My espresso which I think was Rwandan was an interesting experience - I found it salty, was that deliberate?<br>The staff were lovely, and I really liked the vibe that being amongst a gallery gave.<br><br>So, next door, I don&#39;t know what was going on, but I there seemed to be a party going, either a general bar area or one still happening from the night before. Anyway, cue lots of good looking people drinking wine and beer at 11:30am and playing (not too loudly) house music. <br>Now in my opinion, anywhere that allows me to hear house music before midday and gives me an amazing breakfast, can only get 5 stars. And there, Ladies and Gentlemen is why I gave it 5 stars.<br>PS My second choice was going to be the Turkish eggs which looked REALLY good, so bags that for next time.<br><br>In conclusion, I shall be going back, yes :)",
