"reviewcomment":"Fika is a slightly pretentious Shoreditch type place but it actually has some substance behind the hipster froth.  <br><br>I liked the way they presented the cocktails, for example one came with the alcohol in a bag to be added to the drink and another came with the constituent parts in different beakers. The menu was presented on a map and was due to change to winter at the time of our visit. Some Swedish cultural knowledge is required when interpreting the menu as most main courses come with sides that aren&#39;t mentioned. I had the mashed potato and chicken which was really good. The great smell in Fika is caused by the Swedish meatballs so I would recommend those to. <br><br>Overall, despite its hipster pretensions, I quite liked the place and will try and come back in future.",
