"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/-U9O4bn1FOm0qDYfKqZjbQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Nice food in a unique space, especially pleasant when you&#39;re sitting in the &#34;garden&#34; area (glass house of tables at the front of the space with plenty of light streaming through a retractable roof, which they close when the chill of night settles in, or if it begins to rain). <br><br>The food is a different from what you&#39;d find at a curry house (and curries are only a very small part of the menu - think more grilled sauteed or tandoori type of dishes). It&#39;s ordered like small plates - choose 2-3 per person and go to town on the array. The meats can be hit or miss, some were super tender and falling off the bone, others were dry and chewy. However, every dish was extremely flavorful, lots of kick with the heat and heavy on the spices than most. They go similarly extreme on the cream and butter factor, but in the end with small plates this is a good thing... At such concentrations of flavor, a little goes a long way!",
