"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/bg1fqTeKbnBGbWSmTVqiHA/l.jpg",
"rating":"4.0",
"reviewcomment":"Definitely a popular place to settle in after the Columbia Flower Market for your Sunday Roast! <br><br>Ringing in at £19, you get a slice of roast, with yorkshire pudding, cooked greens, carrot mash (with wholegrain mustard), and deep fried potatoes slathered with some really really delicious gravy.  I thought it was a bit pricey for roast (considering you can get it for much cheaper at other places around the city), but I think this is probably the better roast meal I&#39;ve had in London in comparison to the £13 dishes I&#39;ve had. I loved the greens, would happily ask for more to mop up the gravy (though there wasn&#39;t much left).  <br><br>I wasn&#39;t too keen on the carrot mash, so I think I&#39;d ask for all the sides to be swapped out for the greens. yum! <br><br>We also ordered a bowl of triple cooked chips for £3.50 - thick sizeable crispy chunks with garlic aioli.  Some of the best fries I&#39;ve had, very crispy on the outside, fluffy on the inside.  <br><br>Would come back again!",
