"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/OGbhFEyZtF7Lsufid5EbBQ/l.jpg",
"rating":"3.0",
"reviewcomment":"Many years ago when I was a youngster, my mom would take me to TGI Fridays on a Sunday as a treat for going shopping all day ( I was only 6 at the time, and had already built a hatred of shopping!). I remember the original desert dishes and the amazing fun we had. My Mom and I still speak of the happy memories we have there. These have just been built upon with my first visit in over 15 years!<br><br>My friend and I decided to go to a TGI Fridays as we both wanted a steak and a nice big pitcher of beer. We arrived and were shown to a table and discovered after looking at the menu that neither of us wanted the stake any more. I elected to go with the ribs and found them rather tasty, albeit we a wee bit too much sauce. My friend chose  a meat plater and was overly impressed with the amount of food and how good it was!<br><br>The service was as quick as could be, and our waitress was extremely friendly and fun. We agreed we would go back to see if it was just a one off, which it wasn&#39;t... you will see this type of service from all who work here!<br><br>If you are looking for a good place out for lunch with friends, then TGI Fridays might be a good bet!",
