"rating":"4.0",
"reviewcomment":"Of all the places I&#39;ve been to in Soho, this was probably the first bar I visited. Nothing funnier than ordering a pint and thinking to yourself, &#34;Wow.. that&#39;s pretty affordable..&#34; and then have it served in a half-pint (aka child size cup)... a French thing?<br><br>It&#39;s a traditional (closes at 11pm) and tiny place... gets pretty crowded by the bar (aka cozy and intimate) so it may test your patience. Lots of great beer.. the guinness was good, but not the real stuff :(<br><br>Although it doesn&#39;t look like anything French, my buddy who took me says that apparently the place did at least house or serve as a meeting point for the French resistance in London, hence the name... <br><br>All in all, it&#39;s a pretty cool and chill hangout spot... I didn&#39;t try the restaurant, but heard good things... so I&#39;ll have to save that for a followup review",
