"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Dwx2Ko9Pv2WBp5RmrNiBvg/l.jpg",
"rating":"3.5",
"reviewcomment":"As an American who has spent over a year in Europe searching for a decent hamburger has been a personal quest of mine. Finally after endless attempts I found a real, quality American style burger in the heart of London at Byron. The meat was tasty, they actually managed to cook it medium and the flavors were spot on.<br><br>They have American style fast food fries as well as English chips. Other American favorites fill the menu like onion rings and shakes. They even have real A&amp;W Root Beer, a true taste from home I never saw anywhere else in Europe.<br><br>The service at the Kensington High Street location was fast and super friendly. Every waitress in the place was friendly and eager to please. If you&#39;re searching for a bit of economical American food in London I can&#39;t recommend it highly enough. Best burgers I&#39;ve had in Europe by a mile.",
