"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/QVx2J7nkynt6xeOVm5uDcQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I made a reservation for 7pm, however we arrived around 6:30pm, as we were quite hungry, and was seated at the bar until our table would be free. There were quite a lot of free tables in the restaurant. At 7pm we went to ask where our table was, and it was like they had forgotten us.<br><br>They took us to a table that had been free the entire time. <br><br>The atmosphere in the restaurant is quite cool. And i loved the interactive tables, and the ability to order our own food. <br><br>The food came out quite quickly and the staff were attentive on ensuring our wine glass was constantly topped up. <br><br>The portions seem a little off. And the descriptions of the food on the menu are also off. I ordered what i thought was salad, however came served on rice, and for the price was incredibly small. My other guest ordered duck which was in fact cheaper than my dish and was huge. <br><br>I do wonder how they can charge 12.5% for service charge when in fact the staff don&#39;t actually do a whole lot other than deliver your meal to your table. <br><br>I&#39;m a fan because of the atmosphere, and the idea behind the restaurant, but the staff and lack of attentiveness needs work.",
