"rating":"4.5",
"reviewcomment":"I have had this place on my list forever but knew I needed to find a time when we could rock up and get a spot.  That was about 6pm on a Wed eve and we were able to grab seats at a beautiful marble bar facing the window.  It was a great spot because we could have a conversation--it wasn&#39;t too noisy and despite the fact we were a bit nudged in the corner our waiter really looked after us.  (NOTE:  service is not included so don&#39;t forget to tip if you do go and get great service as we did).  <br>The wine was fab.  I was impressed with the tortilla (not as good as Barrafina but probably comes in second on the tortilla ranking).  Croquetas were a spicy spinach--surprising but good.  Gem salad with walnuts and blue cheese was yummy and the Iberian pork was good.  The standout was the asparagus (in season) with romenesco sauce and jamon.  <br>I loved the vibe, the food and the wine.  I felt like I was in Spain.  Salud!",
