"reviewcomment":"Hello hot-pot, where have you been all my life?!<br><br>Thanks to Yee Gan for making arrangements for the evening and to Becky for suggesting the hot pot at a dumplings resto. <br><br>If you&#39;ve never had a hot pot before its pretty rad and easy and yes you will get filled up. Trust.  Its essentially all you can eat meats and veggies for £20 and your food is cooked in a double sided pot with two types of soup atop of a skillet thing in the middle of your table. <br><br>There was lamb, and beef, and mushrooms of different types, and meat balls of different types (i don&#39;t know what they are i just ate them. Don&#39;t ask questions.. just eat) and beautiful shrimps and noodles and spinach and and and and... so much!<br><br>Our technique was to just dump a ton of food in there and then scoop out what you wanted to eat in  few minutes and voila you eat the said meats and things with delicious dipping sauces. <br><br>nom nom nom",
