"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/QlGcGBHAIVCNiwP1_Z93JA/l.jpg",
"rating":"4.0",
"reviewcomment":"Don&#39;t expect anything even remotely similar to the American casual dining chain of a similar name. Expect fresh seafood in a slightly classier environment, with a price to match.<br><br>Got there on a Friday for dinner, early in the evening, and it was pretty packed. We managed to get the last two free seats at tables, though. The service was courteous and speedy. <br><br>The mixed grilled fish platter house specialty with a chips or a rocket salad, which turned out rather fresh. The fish of the day was dover, which came grilled, with nice char marks. There was also a whole shrimp. Apparently this dish changes on the daily, though, so don&#39;t expect the same thing!<br><br>Sea food salad came with mussels, squid, prawns, and scallops, as well as some greens and a citrusy dressing. Everything was fresh and flavorful, if a bit skimpy on the portions. <br><br>Overall, wonderful quality. All of the fish were juicy. The produce was fresh. The proximity to Borough Market and the London Bridge station is such a bonus!",
