"reviewcomment":"We stumbled across this place when we wanted to go somewhere for a quick drink and snack, and ended up having dinner. The bar is quite big and spacious that&#39;s perfect for having huge groups of friends, but there are little tables if you&#39;re with one other person, which is where we sat. It&#39;s great when the sun&#39;s out because the sunlight pours through the big windows and right where you sit. <br><br>We ordered drinks and three appetisers: fried wings, nachos and cajun fries. They came in huge portions so if you&#39;re looking for just a light meal, don&#39;t order too much! The fried wings were definitely my favourite... crispy on the outside and so juicy on the inside. The whole thing was covered in buttery bread crumbs, which I&#39;ve never had before. Absolutely addicting. The nachos were great as well, just enough stuff on top so there was no chips left behind. The fries were covered with cajun powder-stuff along with cajun mayo... the whole combination was phenomenal. <br><br>Just the three choices left us completely full and satisfied. Felt really guilty because it was so unhealthy but hey, that&#39;s what weekend gluttony is for. So if you&#39;re down for a fattening experience with a bunch of friends, this is a great place to indulge :)",
