"reviewcomment":"This is far and away my favourite burrito place in West London, and currently in London altogether. There are other good burrito places, but what make Benito&#39;s Hat stand out is the ingredients.<br><br>I work nearby, so we walk over fairly often. They change what they have on offer. Unlike Chipotle or Tortilla (both fine in their own ways), Benito&#39;s hat changes things up from time to time. I&#39;ve had spicy tofu, spicy mushrooms, and different kinds of vegetables. They also have my favourite Mexican beer (Negra Modelo) and they serve it with a lime (just like they do in the US). It&#39;s also nice to get a few tortilla chips thrown in when you get a burrito. We usually munch on those during our walk back to the office.",
