"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/x0IFQ3MBJu2LaKhQQpkQHA/l.jpg",
"rating":"3.5",
"reviewcomment":"I went to the qype event on making sushi and it was fabulous. Silla&#39;s (the owner of Feng sushi) passion for what they do really shone through and their commitment to sustainable fish is admirable. The fact that even someone as cack handed as me managed to turn out reasonable looking sushi rolls is testament to the brilliance of this class. I would definately recommend trying one of their sushi making clases and impressing the hell out of your friends with home made sushi the next time you throw a soiree! And if it all goes horribly wrong the Feng Sushi delivery service will save you, shh they&#39;ll never tell that it was them who made it ;-)<br><br>My favourites were the crab, avocado and mayo, a classic combo that really works in a sushi roll and the salmon nigiri topped with beautiful pea shoots, that was almost too pretty to eat. Almost.<br><br>I have to say the BBQ was a bit too salty for my taste but I have really cut down on my salt so I think that is just my personal opinion and certainly one that did not seem to be reflected by others around the table!",
