"reviewcomment":"Great location for this pub (just a bit south from London Bridge, on the corner at Stony St. right next to Borough Market. Had an interesting beer, here, Stonehenge Eye Catcher, but tended to gravitate back to the more traditional London ales. Good service during the afternoon (both at the bar and at the table) at midday when the place was a little less crowded.  It gets hectic later on, though. The afterwork crowd fills the place later on making the service understandably less reliable. Food is pub classics, mediocre, but what you want in a pub. Great place for a pint off Borough Market if you&#39;re headed this way for the day.<br><br>I was a tourist here but felt like I was treated as a regular, so that scores high in my book.",
