"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Bt1vkIhVg43-G-Tr97bfwg/l.jpg",
"rating":"4.5",
"reviewcomment":"World class hospitality with the best Indian tasting menu ever. Have been dining here since it opened in the year 2008 and must say it has never failed to impress me. I have taken a variety of my clients here and they all are converted to Modern indian food lovers. Tucked in devonshire square, this stylish Indian restaurant was a great find then and now with their renovated cocktail Bar Anise, It has yet again become my favourite eating spot in East London.<br><br>Go here if you want to try something different and unique like Red deer, Squab pigeon, Bar food, Tandoor grill spice platter.<br><br>If you are a vegetarian, you will be well looked after by head Chef Abdul and his team but just give them a nudge as sometimes, you may not get a lot of options listed on the menu.<br><br>Best dishes to try are:<br>Corn soup with fritters<br>Grill platter if you want to try the grill dishes<br>Green pea relish tastes a bit like wasabi but it&#39;s not:)<br><br>Cons: <br>No parking on site but that&#39;s with any London restaurant<br>Smoking not on site but you can just walk up to the exit<br>Reservation is recommended especially on Thursday, Fri and Sat",
