"rating":"3.0",
"reviewcomment":"I scored a free meal here during the launch of the City Hawk app. It was a nice night out but Ruby Blue didn&#39;t wow me enough to come back, which I always think is a shame.<br><br>When we arrived, we were one of two tables in whole dining area. They sat us in the middle of the restaurant, but we asked if we could move to a comfier seat with no luck. Before we knew it we were the only ones in the restaurant. Remind me again why we couldn&#39;t move?!<br><br>Obviously, because the meal was free, we were dining on a select menu. We ordered the chicken wings, the fajitas and the ribs. The presentation was nice but the quantity and quality of the food was not outstanding. We shared a pitcher of pornstar margaritas, which were really good, but I&#39;m not sure about the value for money on that one.<br><br>Reading some of the other reviews, I&#39;m not really surprised as I see what they are saying. Ruby Blue isn&#39;t known for being a restaurant, but more as bar. Clearly, the reason for this is the food itself. It&#39;s not somewhere I would bring someone for a sit down meal in Leicester Square. They have the prime location, but I think more effort needs to be put into the food side of Ruby Blue if they want to build a better reputation for the restaurant.",
