"rating":"3.0",
"reviewcomment":"If you are not made of £50 notes or not a regular on the TV then this probably wont be a place for you. <br>I only used to go because my friend had influence there and although yes the nights were fun and you would always be sure to see some sort of A,B.C list celeb it was because of this it could become quite daunting. <br><br>On a weekend this place will always fill out, the doormen are not stupid and either are the management. As a priority they allow in lots of bimbo chicks who are either some sort of kiss n tell types, or high class prostitutes who are purely there to hunt soap stars, or footballers and get their own name in the tabloids. So yeah lots of fake smiles and laughter when you go in.  <br><br>On the best nights the women would be normal, approachable types which is much better and the crowd would not be so posey. <br>Having seen how security behaves and how people get turned away for the most stupidest reason this place loses points. <br>Once you are in through the doors you will probably always have a good night but do have a few drinks before you come here so its easier to relax around what could be the most pretence crowd ever.",
