"reviewcomment":"This is one of my favourite restaurants in London. <br><br>The service is excellent. You will instantly be greeted by all their staff as you enter the place. Whether you like your meat or are vegetarian, you will find something to suit your tastes in the menu. <br><br>We chose a selection of starters including the traditional chicken satay and nems with papayas. It was all delicious ! The mains didn&#39;t disappoint either with a tasty seabass and a veggie pad thai. <br><br>If you are wandering around Angel and are looking for a nice Thai restaurant in the area, I would strongly recommend this place.",
