"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ttIzepdpdKGlfgpxKyZB-Q/l.jpg",
"rating":"3.5",
"reviewcomment":"It&#39;s been a while since I&#39;ve been to Sake No Hana, but I went back last weekend to their bar, where they were celebrating the Japanese cherry blossom season by decking out their entire bar with pink cherry blossoms. Quite a sight!<br><br>There was also a special sakura season menu, with cherry blossoms and cherries featuring in drinks and desserts, as well as a double layer bento box for lunch.<br><br>If you go, do see if they have a double layer bento box, as it was quite a sight and even tastier to eat! One layer of scrumptious sushi and sashimi, and the other with the two hot courses.<br><br>Desserts were amazing, although slightly too rich for my tastes but if you like chocolate you would definitely enjoy. Cocktails were well crafted, and service was excellent.<br><br>The best thing though about Sake No Hana is that while it is just moments away from the hustle and bustle of Piccadilly, it was like an oasis of tranquility, made even more so by the pop-up sakura garden for these few weeks.",
