"reviewcomment":"It it&#39;s very convenient and the decor is nice. I ordered the Firecracker with prawns. The flavors were GREAT but it was incredibly spicy. When I ordered it, our nice waitress warned me that it was spicy. The menu said the same, but I assumed that she was only exaggerating. I consider myself a spice lover, but this was way out of my realm. Like I said, the flavor was great, so if not for the immense spice, it would be a five-star dish. It seems like instead of listing it as &#34;spicy,&#34; the menu should have classified it as &#34;very spicy.&#34; Everyone else in my six-person party enjoyed their food, so the spice in my dish is the only thing holding it back from a five-star review.",
