"reviewcomment":"Heaven in a hotpot! The hotpot definitely outshines the rest they have on the menu. The broth is so thick and rich in flavors. It doesn&#39;t taste too spicy even though it looks so, but you can also taste sweetness. The pot has everything from marinated sliced beef, tofu, onion, kimchi and a selection of vegetables. They also have pork, seafood and kimchi hotpot. <br><br>The seafood pancake was alright. It doesn&#39;t come in small portion so it&#39;s good for a shared starter. I thought the dipping sauce wasn&#39;t so good. It&#39;s just a plain soy sauce without additional spices. <br><br>My favorite menus in Korean restaurant are japchae or vegetable fried glass noodles and BBQ ribs. Both were well served in Assa but the BBQ portion is small so you may want to order more if you consider eating just it. <br><br>Additional kimchi side is £2.50 and they give seaweed pickle and bean sprouts for free with free flow cold ginseng tea. <br><br>The place is rather small and can get very busy during lunch or dinner time. You will see a queue in front of this place but make sure you don&#39;t enter the other Assa next door (Japanese).",
