"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ZrkKuhno5orPtsUATojCpg/l.jpg",
"rating":"4.0",
"reviewcomment":"Fun little upstairs tapas bar in Covent Garden close to and around the corner from the Royal Opera House, run by the same talented tapas crew as London&#39;s Salt Yard.<br><br>Nice service experience.  Recommend getting a bottle of wine (this is a tapas restaurant, after all) We ordered up about 5 dishes for two including: grilled octopus (tasty, but too small), papas fritas, pork loin, mini burger with foie (slightly overdone meat on the burger, but nice sauce) and their sweet potato tapas dish.  <br><br>Your meal will come with grilled bread and small, grilled mild, green, charred Spanish peppers. Very tasty accompaniments. (BTW, if you want more bread, you will have to ask for it, as it will not be offered. My only real ding on this place. This is a tapas restaurant, after all, and bread should be easier to come by.)<br><br>Nice Covent Garden ambiance, although somewhat of a dated dining room with lots of 90s burgundy and black.  Afterwards, walk around the Apple Market for a late night Covent Garden feel. Wondering outloud if Gwyneth Paltrow named her daughter after a Victorian night market in Covent Garden in her throws of London amore?",
