"rating":"3.5",
"reviewcomment":"Well, I&#39;m at home on a Sunday, with nothing better to do than to write a tremendously short and stuffed with mixed feelings review. As you can see from my stars, the good has defeated the not-so-good in the end and the jerk has won me over to the jerk side.<br><br>I really like the word &#39;jerk&#39;, it sounds funny and it carries a certain ring to it if you keep saying it over and over. You&#39;ll find a lot of jerk here, it&#39;s the City of Jerk we&#39;re talking about. They serve quite big portions and it&#39;s not like there&#39;s a plate full of veggies with a miniature piece of chicken - the meat and veggies are equally distributed and you&#39;ll find it surprising that you&#39;ll run out of both at the same time. <br><br>It&#39;s not very expensive, yet some of the dishes seem a tad overpriced as opposed to some other joints in the area.",
