"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/VNvddySa2PAhXe9OJnaqqA/l.jpg",
"rating":"4.0",
"reviewcomment":"If there&#39;s one sure thing about Malaysian food, it&#39;s that you can really re-create it outside Malaysia. There&#39;s just too many variables to take into account that can&#39;t be recreated in a building, particularly one that has to meet food hygiene and safety standards!<br><br>This said Satay House is one of the better Malaysian restaurants that tries it&#39;s best to recreate the more formal malaysian dining experience that you can get particularly in the capital of Malaysia. The sambals and chilli are not as I remember them, not as spicy and sweeter, but the satay with compressed rice, onion and cucumber were great. As was the coconut rice. Fluffy and not too salty.<br><br>Each dish had plenty of flavour and the portions were decent. Whilst there is limited seating upstairs, downstairs, we were situated in a quite luxurious booth where there was a nice HD tv screening the football. It wasn&#39;t at a perfect angle for the table, but get there early and you&#39;ll have some additional entertainment to the company :)",
