"reviewcomment":"3.5 stars, why don&#39;t you exist?<br><br>We came in on a Saturday afternoon.  The restaurant was empty and we sat at the bar. <br><br>The Cornish crab starter with toast was good. Freshly shelled crab (both brown and white!) with a squeeze of lemon was good but slightly on the bland side. <br><br>I had the breaded pork with brown butter and capers. The crispy breaded coating covered a nice thin slice of pork.  It was tasty and could have done with a bit more of the brown butter.  It came topped with a slightly overcooked egg.  I ordered a side of sprouting broccoli as well.<br><br>My partner had the fish pie.  What can I say, it was a fish pie.  Tasty but slightly heavy handed on the dill.<br><br>We had a very nice bottle of pinot noir though.  Very smooth.<br><br>Overall, it was a good meal but not necessarily over the top amazing.  The restaurant has a nice atmosphere without being pretentious which I really appreciated.  A good place for a lazy meal!",
