"rating":"4.0",
"reviewcomment":"The ultimate in pub food. I&#39;ve been here twice - the first time for an anniversary and the second as a place to bring the parents. The first time we were sat upstairs, and it was lovely - I believe I wrote a review on this a while back. The most recent time, the upstairs was reserved for a private party so we sat downstairs and it was such a different experience. <br><br>The atmosphere downstairs is more of a pub with tables crammed in, if that makes sense. But the food is, of course, just as good - my parents both had the onglet and loved it; I had the fish and chips and it was great! The peas weren&#39;t overly pureed, the breading was crispy... all in all, a very good pub fish and chips. <br><br>The pub itself is on the outskirts of Kentish Town, just past Gospel Oak overground station. A bit easy to miss. But worth it - for the food, at least. There&#39;s not a lot of space to stand around and have a pint after work, unfortunately.",
