"rating":"3.5",
"reviewcomment":"I love this place. I&#39;m a huge sushi fan but would never have considered coming here if not for a friend inviting me to dinner. <br><br>We sat at a table not at the carousel and indulged on a variety of sushi and sashimi, all of which was fresh without any fishy smell to it. I especially like their warm plates which are a brilliant idea for when you want to have sushi and can&#39;t eat a whole chicken and rice meal. These guys have you totally covered with their little plates of menu items which ordinarily come as a rice and meat dish but instead are served on a little sushi plate at a fraction of the cost. Brilliant!<br><br>Sadly I haven&#39;t been back here since as it&#39;s not really close to anywhere I need to be on a regular basis but next time I&#39;m in Holborn or perhaps visiting the National Gallery, I&#39;ll see if it&#39;s possible to stop by for lunch.<br><br>Also, 10% discount for students. Score!",
