"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/hVD9RdZGgeCFtzY4pdP_IQ/l.jpg",
"rating":"2.5",
"reviewcomment":"Feels like America when I was eating here. This place offers you a range of burger selection complete with the sides you have been craving for and milkshakes. Their burger is mouthful, it literally is the size of my mouth. But it tasted so well, even better with the fries and a bit of jalapeño to spice it up. <br><br>The staff was wonderful. They asked me how I want the meat to be and recommended if I wanted any sides with it. When my food came, it looked so yummy and made me decided to put away the utensils and ate it with bare hands instead. The beef patty was just like the way I wanted it and it comes with bright red jalapeño and blue cheese, all served to perfection. All the fries were good. The sweet potato was special and cheesy fries was absolutely luscious. <br><br>I could still smell the blue cheese and onion on my fingers after the diner. But I loved it. It made me want to come back.",
