"reviewcomment":"Best hog dog in London? You bet!<br><br>I have sampled a Big Apple hot dog on a couple of occasions and if different locations, but the most memorable was at Grillstock in Bristol.<br><br>I was there for the weekend, so on the Saturday I treated myself to a &#39;Huge Pole&#39; a succulent 8 inch beef &amp; pork dog sausage seasoned with sage, mace and cayenne peppe, a real mouth fall, really delicious!<br><br>Then on the Sunday we were back, my mate Dave was chatting away to the owner Abiye and the topic food challenges came up, then Abiye laid down the challenge, some guy had done a double &#39;Huge Pole&#39; but someone needed to take it up a notch, yep, that guy was me.<br><br>The Triple Pole: The deal was I had to fit a everything in my gob and have a bite, then I had to finish the beast and If I completed the challenge, the &#39;Triple Pole&#39; would be on Abiye.<br><br>Guess what? I demolished it with ease, and the main reason was the standard of those sausages, so tasty I manged three of the buggers and that&#39;s why Big Apple Hot Dogs is the best hot dog in London.",
