"reviewcomment":"Stumbled upon this place on a flying visit to the big smoke one busy Friday night.situated between Regent&#39;s Street and Carnaby Street the place looked busy and inviting so we thought we&#39;d give it a go.Right, the negatives first.<br>The service was slow, sit downwait.eventually get a waiters attention, order food and drinkswait..drinks eventually turn up.wait.you can see your order by the grill..waitone of the orders arrives (you have to ask for cutlery) the waiter then takes someone else&#39;s order before getting the rest if your meal!!!!! (words were exchanged! )<br>Yes they were busy but this is the worst service I have received for years, very very poor.<br>Now the food.I went for my old favourite Blue Cheese and Bacon Burger.It looked good, nice ciabatta roll, lettuce, tomato and red onion salad inside, it tasted sensational, incredibly tasty meat, subtle blue cheese sauce, lovely crispy bacon, I had a side of chips which I pretty much ignored, so good was the burger.<br>Yes the service was pants, but I&#39;d go back tomorrow so good was the food.<br>(Probably the BEST burger I can remember tasting for a long long time)<br>My partner had the Tex Mex Burger (jalapenos, guacamole, bacon) and see was also blown away by the quality!<br>Stunning food.",
