"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ckaIOUu1RsJjlqfUt2bLmQ/l.jpg",
"rating":"4.0",
"reviewcomment":"One of my favorite fast food eateries in America is Chipotle. As with most American imports, the food here is priced by replacing the $ with a £, thus making it overpriced. I patronized a London Chipotle once and vowed to never return.<br><br>Today I discovered Tortilla and finally satisfied my craving for inexpensive Mexican food! They essentially offer the same options as Chipotle, with minor differences:<br>- Spanish rice (in addition to cilantro/lime rice)<br>- Diced onions<br>- Shredded AND chopped lettuce (oh boy!)<br><br>Anyways, though the food isn&#39;t anything to write home about, I gave Tortilla 4 stars because of the price point. The medium burritos and burrito bowls are only £4.95. It&#39;s much cheaper than it&#39;s competitor Chipotle, and affordable on my student budget. Also this location offers tons of seating on the main level and upstairs, or you can go outside and enjoy the views of Bankside.",
