"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/BSAGSimPiJ5xYJ6Oz1i8ZQ/l.jpg",
"rating":"4.0",
"reviewcomment":"A GREAT CHEAP MEAL IN CENTRAL LONDON!!!! I didn&#39;t believe such a thing existed, but Soho Joe is there to prove me wrong.<br><br>I turned up to see some friends who had already ordered some pizzas to take out.  Next thing I know a beer has been put in front of me - apparently you get a free beer while you wait.  That was a good start.  The pizzas are £12, so very reasonably priced.  I ordered the Soho Joe Special, which had aubergine, artichoke, parma ham and other stuff.  It was a decent classic italian style thin crust pizza.  All the ingredients were cooked perfectly, and I liked how the ingredients were just draped over the pizza without too much care for making each slice equal.  Being italian style, most the pizzas were various combinations of parma ham, pepperoni and vegetables.  Don&#39;t expect anything like a meat feast.<br><br>The staff are all really friendly and chatty.  The decor is bohemian chic, so the same as pretty much everywhere else.  <br><br>We got our pizzas before we even finished our beers.  Then we went down to soho square to eat in the sun.  Would definitely go back!",
