"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/P4Iy2b_YDUfenlfixffKGA/l.jpg",
"rating":"4.0",
"reviewcomment":"Went to this place on my last night in London and my experience helped make it one of the best nights of my month-long stay in England. <br><br>We got a bottle of wine to split between four of us and enjoyed the outdoor seating with a view of the Market. We split aioli with bread that I only wish I could recreate. I got the wilted spinach with pine nuts and chorizo with rocket and roasted red peppers on grilled bread. I have tried to recreate both because they were so insanely delicious. <br><br>There are certain spots that I&#39;ve encountered in my travels that make me want to go back to the city just to experience again. I can&#39;t wait for the next time I travel to London so that I can order that meal one more time. I won&#39;t even go near any tapas places in New York because I&#39;m afraid it&#39;ll taint my experience at Brindasa.<br><br>Great to walk around Borough Market first and then stop off for dinner before a show at the Globe or some sight-seeing. Also great date spot. I went in early August during the last week of the 2012 Olympics and even then it was peaceful, relaxing, and not at all over-crowded.",
