"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/5qQbNhKzp_JKcc5whRE5dg/l.jpg",
"rating":"3.0",
"reviewcomment":"This is a review for nightlife and not food. <br><br>My 2 friends, sister, and I were walking around close to where our hotel was located and every place seemed pretty dead. This was surprising to me since it was Eurocup so I thought everywhere would be a bit lively. Not so much. We walked by The Rocket that had a decent amount of people and a DJ inside. Finally!<br><br>We had sooooooooooooooooo much fun here, so much that we came back again for our last night in London too. We were drinking Tetley&#39;s mostly, which I liked, and Jagerbombs haha. We freakin limboed here. Limbo. I haven&#39;t done that in foreeevverrrr. Then we did this weird dance with guys and girls, which I hated, but whatever, all in good fun. There was a Journey sing-a-long at the end of the night. Typical bar fun. If I had been home, I probably wouldn&#39;t have been too ecstatic about the limbo and things, and would probably have rolled my eyes with a &#34;what grade are we in again,&#34; type of question. But hey, when you&#39;re a tourist, you have to enjoy it to the fullest extent. It&#39;s one of the only times people actually expect you to act like fools. We definitely lived it up at The Rocket.",
