"rating":"3.0",
"reviewcomment":"My Dad and I popped in here after long, successful loop around the city by foot. I was excited to eat here because it seemed more bistro than pub food. After a rough go of getting a table ( I won&#39;t dwell only because I had a glass of wine in my hand) we were seated and had the best service of our entire UK trip. Very attentive and friendly. I noticed that once we had our food in most UK restaurants your waiter literally disappears. Forever. Anywhoo... <br><br>We started with the salmon pate, I had the Welsh Rarebit and my dad the Beef Wellington. Loved my pate, liked my Dad&#39;s wellington, and an OK for my rarebit. I was told I HAD to try welsh rarebit while in the UK. It was just too rich for me and you get four slices of bread! <br><br>I don&#39;t suggest coming across town to try this place but if your in the neighborhood might as well give it a go.",
