"reviewcomment":"Jesus-tap-dancing-Christ this place is good. I came here with a group of people at about 9pm on a Friday and they seated us with no fuss. It was pretty busy, especially outside where people were smoking Shisha.<br><br>The service was friendly and very quick. We ordered a mixture of mezzé starters and main courses to share - all of which were very tasty. I had stuffed vine leaves, which were lovely, and my chicken stew was great. The portions were huuuuuuuge - we were all really full after the starters, so barely made a dent on the main courses.<br><br>It&#39;s a no-alcohol restaurant, but there are loads of fresh juices and smoothies to have, plus the usual sodas and everything.<br><br>Did I mention that this place is cheap? There were 5 of us and each of us had a starter, a main and a drink. The bill? Sixty of the Queen&#39;s finest pound notes. As Tim Wonnacott would say, that&#39;s a bargain.",
