"rating":"3.5",
"reviewcomment":"My Spanish colleague took me here, along with another colleague who lived in Spain for several years. So that says something.<br><br>This is the perfect lunch place. It&#39;s run by all Spanish people and all goes very fast. You first choose the main (most of the people go for the burrito obviously) then the topping/filling. I had the Chicken Mole with almost all toppings (though did not really notice any chocolate like the menu says, which I think I&#39;m glad for) including the beans, and was not disappointed at all. Chicken was really tender, and the size was perfect for lunch. We all had a Corona beer along with it, as you do at such a place.<br><br>They have some basic chairs and tables in the back where you can sit cozy, but when the weather turns better, I&#39;m pretty sure we&#39;re going for the take-away option to eat outside somewhere. <br><br>One of the better burritos I&#39;ve had in London so far!",
