"ogimage":"http://s3-media3.fl.yelpcdn.com/bphoto/IP19ZLhIVQ4Ygu5o_npsOQ/l.jpg",
"rating":"4.0",
"reviewcomment":"We&#39;re minutes, no seconds, away from Piccadilly Circus. <br>The chicken is cheaper than I pay for the same in Islington and even Hackney.<br>The wine bottles start around £15 and is perfectly decent stuff.<br>The chicken is delicious!<br>Service is friendly with a bit of cheekiness thrown in for good measure.<br>You can BOOK a table!<br>The place is stylish with that industrial vibe.<br>Two bottles of wine, loads of chicken, sides and sauces comes to £30 per head including service for three people.<br>They even have a few free seats on a Saturday night - where is everyone<br><br>Erm, of course it&#39;s 5 stars. This is PICCADILLY people. You&#39;d pay more at the one of those awful steakhouses for food poisoning and you wouldn&#39;t even enjoy it.<br><br>So yeah, if you&#39;re in the area or planning to be, give it a go. It&#39;s gooooood.",
