"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/QSyGswgrp61KQPcb1jp3EQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Nipped in for a quick lunch, and I was pretty impressed with the menu. For a start, you can easily get lunch for a fiver, which I&#39;ve come to think is impossible in London town, and secondly the service was really quick and accommodating since we turned up in two big groups at different times. <br><br>My instant regret was not trying the burgers. When everyone around you gets a huge hunk of delicious patty and you&#39;ve gone the &#39;sensible&#39; route with a halloumi wrap, I challenge you not to be jealous. (Unless you&#39;re veggie, naturally.) By all accounts, those burgers looked phat and juicy. <br><br>However, the halloumi wrap, friends, is definitely worth a look. None of that scrimping on cheese, the slices were huge. And the sauce, yoghurt (or creme fraiche?) and some kind of Mexican flavoured stuff, was pretty delicious. It came with salad and crisps, which were more than I could finish.<br><br>Love the vibe -- trad pub feel, tables outside for a warmer day, and great friendly staff. Put it on your list if you&#39;re in the area.",
