"rating":"3.5",
"reviewcomment":"When it comes to local dining at a good price and quality, The Exhibit  has it. Since moving to Balham we&#39;ve come here for more than a good couple of meals. Their 3-9-3 menu (£3 - starter, £9 - main, £3 - dessert) is well worth what&#39;s on offer and their staff are always friendly. <br><br>More recently we went to try their new spring menu at a discount of 50% on all food. I had the duck fillet salad to start with rocket and vinaigrette, then the lamb&#39;s liver with mash and a mouth-watering gravy and I just couldn&#39;t resist the rhubarb compote to end the meal with. Their portions are generous and 3 courses may be a but much for the average person. <br><br>There is also a cinema there which shows relatively new movies in an intimate setting of 12 two-seater couches. You can order your drinks from the bar and bring them in with you and tickets are £5 and I think less if you eat in restaurant as well. We&#39;ve always had a good experience there and even without the 50% discount you still get good, big hearty food at very reasonable prices.<br><br>If you do order the compote, I advise sharing it between two seeing as in comes in a big oval ramekin! I only got through half of it and I&#39;m usually a rhubarb monster.",
