"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/mhOpxYm6SAfQ833FXmU1Xg/l.jpg",
"rating":"4.0",
"reviewcomment":"After an impromptu group outing, I showed up on a weeknight with a group of 20 and no reservation, and was seated within 10 minutes. I was told I was very lucky because they were having a slow night and usually it would be impossible to seat a party so large. That being said the hostess was incredibly accommodating and arranged the tables for us without making a fuss. The service was great and everyone was attended to in a timely manner. Furthermore, the food was incredible, and was not too expensive. <br><br>I had the prawns, which were huge, savory, and delicious. I also tried the best fish and chips I&#39;ve ever tasted - the fish was crispy on the outside, tender on the inside. Everyone said their plates were delicious, and I was so relieved that everyone enjoyed the meal. I have only passed through London for a few days at a time, and Admiral Codrington&#39;s is definitely the best &#34;British style&#34; food I&#39;ve had in the area.",
