"rating":"3.5",
"reviewcomment":"Comptoir Libanais is perfect for a quick break when you&#39;re shopping.<br><br>My fiancée and I regularly end up here (either of we&#39;ve decided to walk from home, via Regents park and Marylebone into town...or if we&#39;ve been shopping and need a sugar fix before we can face any more time on Oxford street..)<br><br>* It&#39;s bright and cheerful looking. <br>* We normally grab tea/coffee (or a frozen &#34;mira&#34; minty ice drink - yum!)<br>* The baklava is a little pricey compared to other places in London, but it is fresh and delicious!<br>* I&#39;ve only actually eaten lunch here once, but the lamb and prune tagine was lovely, as was the flat bread with halloumi...<br><br>It&#39;s not the best Lebanese food I&#39;ve ever had, but it is perfect for a quick stop. Nom.",
