"ogimage":"http://s3-media4.fl.yelpcdn.com/bphoto/2HeQv7b6Dcsn7PSrvDjqDA/l.jpg",
"rating":"4.0",
"reviewcomment":"The menu had so many different things that we wanted to try that it was a struggle to decide on what to order.  It&#39;s definitely a spot worth going to if you have a lot of people so you can try an array of things.<br><br>We started with a mixed appetiser plate which included green beans, chicken and bamboo shoots in some sort of peanut sauce, short ribs in a sweet sauce with sesame seeds, some sort of beef jerky strips in chilli oil and peanuts.  All were really good.  The beef was particularly interesting.  <br><br>Our waiter recommended deep fried fish with bell peppers.  The dish had a slight kick to it and the fish fillets were coated in a nice salty batter.  Really yummy.  We ordered some tofu to go with it which wasn&#39;t anything special.  I could have easily made this at home.<br><br>The service was great as well.  Everyone speaks English and were happy to have a chat about the menu.  I&#39;d definitely return to try some more!  Beware, the restaurant gets very very loud if it&#39;s crowded.",
