"reviewcomment":"If you want a delicious steak, great service, and wine, Gaucho is the place for you. I wouldn&#39;t recommend going with a vegetarian. While they do have vegetarian options on the menu the decor is reminiscent of cows with cow skin chairs etc... <br><br>This is the only good steak I have found in all of England, and that is because it is real Argentinian Beef. <br><br>Everything was delicious. If you order medium rare, they will come a bit on the rare side, but will be tender and delicious. <br><br>We ordered chips, spinach, and corn as sides and found it was too much food for us to get through for  2 of us. <br><br>I would definitely recommend it and hope to go back soon!",
