"rating":"3.0",
"reviewcomment":"I&#39;ve never been to any damned santacon but my record was somewhat broken when I arrived in London from Geneva with a Santa outfit waiting for me. Though my spotless record is intact since I missed it and was just a Santa for one picture and just the after parties.  Ended up in soho at 3am and ravenous after a night of drinking and running about and being obnoxious in general.  This place was still serving food!<br><br>Not bad either for late night food.  Why can&#39;t SF be like this?!  We had duck spring rolls, pork belly, fish and chips, more booze: a bottle of Rioja and a port and a Madeira.  Made friends discussing personality disorders with the Scottish traveller next to us before stumbling off into the night where it took another hour to flag down a cab.  <br><br>So sums up my first re-entry to London after an absence of 3 ( I think ) years!",
