"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/DkIOVmiSz7QUz5fdYYAQWA/l.jpg",
"rating":"3.5",
"reviewcomment":"So before heading off to dinner, I treated an old work colleague to a cocktail. She is a big martini fan, so I thought that Christopher&#39;s would work for her. Now I&#39;ve been here before, only for a cocktail mind you and rated it 3 stars. Rude waiters in particular I seem to remember.<br>This time our waitress obviously got out of bed on the right side today as she was very pleasant indeed. We hadn&#39;t made a reservation but grabbed a space on the long bar that glows from within (much like the saying about a pregnant woman). I ordered a lychee and strawberry martini, which was INCREDIBLE. I was intrigued because lychee is such a delicate and subtle flavour it easily have been overpowered by the other ingredients. It was like sipping nectar of the gods, seriously impressive and beautifully balanced. For £11 I was more than happy!<br>My friend had an elderflower &amp; blueberry martini, also really nice but a bit strong on the blueberry for me (I am a massive fan of elderflower though). She was very happy though and was raving about it all over dinner, to the annoyance of the next place we went to (she compared everything to this drink and found it wanting!)<br><br>Well played Christopher&#39;s, you are redeemed",
