"rating":"4.0",
"reviewcomment":"I used to treat myself to coming here on my lunch break back when I worked in nearby Sheldon Square; it was always busy then, and when I returned with a friend last night, it was even busier. Our 2 minute wait for a table to become available, was barely noticed due to the friendly staff explaining specials and getting us menus. <br><br>The menu is full of typical middle eastern fare to suit any taste. We chose to start with some deliciously smooth homemade hummus, and fresh flat bread. This was followed up by a whole roasted baby chicken and my friend a lamb shawarma.<br><br>The place didn&#39;t quieten down the whole time we were there, with people coming to sit down as well as queue up for take away. This small place has an easy atmosphere about it; between the close knit tables glances and comments were shared about how good everything is. <br><br>For us, it was the perfect extension to a few pints in the pub, and with it&#39;s close proximity to Paddington, it could serve as the ideal destination for something a bit different to munch on the last train home!",
