"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/toe3visHhILDQ9zoQm-5Fw/l.jpg",
"rating":"3.5",
"reviewcomment":"I remember I saved up all my tips for a few weeks to splurge on the AYCE menu!<br><br>As the &#34;American&#34; and Californian, sushi in the AYCE form usually means it&#39;s been sitting out for quite a while and hopelessly staring at the passer-by with hopes of being the &#34;CHOSEN.&#34; However, Hi Sushi makes it as you order it.<br><br>The staff provided my native London friend and I will a menu and a dry erase marker. As a result, we planned out our 5 rounds of food which included appetizers, all the sushi and dessert.<br><br>Just a note, there is a 2 hour limit so you best prepare yourself to eat efficiently paired with the amazing ability of enjoying the food and having a fruitful conversation simultaneously!<br><br>For the Americans, the sushi is smaller that our American sizes, but you should expect that! It&#39;s European portions (no offense intended, I like how I don&#39;t have to ask for a to-go box).<br><br>I recall the restaurant being loud due to the music. My friend and I had to yell at each other just to hold a conversation.<br><br>Until next time, happy travels and grubbin&#39; across the pond!",
