"rating":"3.0",
"reviewcomment":"I was at Sway bar a few nights ago as part of a big party in one of the downstairs rooms (the Milk Bar, to be specific). I mention this because it means that I obviously had a bit of an unusual experience, but there are some things I can comment on that I think are general about the place.<br><br>First, the service was quite good, considering how busy and big of a group we were.  The bartenders were able to quickly make drinks, handle transactions, and patiently put up with a whole lot of increasingly drunk people who basically didn&#39;t want to go home (woo, end of finals!).<br><br>The drinks themselves were alright--pretty high priced, though I guess that&#39;s part and parcel with the neighborhood. We also had a chance to try food, which was great bar food--wings, pizza, fries, etc. All of it was piping hot and very tasty!<br><br>Overall, it was nice enough--I had a good time dancing and letting go of some stress. I&#39;m not sure it&#39;s my typical cup of tea, but it&#39;s a good place if you&#39;re into cocktail bars with a little bit of funkiness to them.",
