"rating":"4.5",
"reviewcomment":"I really like chilling out for hours here.<br><br> Location &amp; opening times<br>This wine bar is not big so it tends to get very busy, crowded most of the weekend afternoons. The secret is, it is now opened to 10pm, the perfect place in late afternoon when most of the cafes are closed, restaurants not opened for dinner yet, and pubs boring and empty.<br><br> Nice location - close to Liberty, Soho, there&#39;s even the Riflemaker Gallery just round the corner.<br><br> Wine &amp; food<br>My usual favourite here are Cote du Rhone, grilled chorizo, ham, manchego cheese and extra toasted bread (drizzled with fragrant olive oil). There are lots offered on the menu, and all of them are prepared, served with care, to customers who all look the discerning kind. You could order fizzy water, but i usually help myself to the lemon scented water served in water jugs on the counter bar. The food portion is not big, but enough to satisfy appetite of most sizes.<br><br> Ambience<br>The crowd is varied, from young 20&#39;s to etc, friends, dates, families. Atmosphere is relaxed. Very civilised, now who doesn&#39;t like that ?",
