"rating":"4.5",
"reviewcomment":"I absolutely adore this place.  Especially in the Winter!  When it&#39;s freezing, rainy, and windy outside, you can always count on The Pig and Butcher to be toasty warm.  It&#39;s like snuggling up inside someone&#39;s living room.  You can relax, have a few glasses of wine, and forget about the horrible weather.<br><br>The food is delicious -it&#39;s one of our favorite places to go for Sunday Roast.  They come around with a selection of mustards and horseradish which compliment the meat choices perfectly. <br><br>Other dishes we&#39;ve enjoyed:  Wild boar tagliatelle and the garlic gnocchi.  <br><br>The Pig and Butcher is definitely our go-to gastropub.  It&#39;s not where we would pick just to go for a pint due to a lack of available space (it&#39;s usually booked up, so make a reservation!), but the food is fantastic.",
