"rating":"4.5",
"reviewcomment":"Rustic but modern, intimate feel. There are normal tables in the front, then a couple very large L-shaped wraparound leather seating areas (perfect for a big group or to cozy up next to someone) and a small back patio (just a couple tables in a very narrow space) to eat outside. <br><br>Impeccable service. Our waitress had many recommendations and was quite attentive. We did go on a Sunday morning so there wasn&#39;t much traffic. I&#39;m surprised there weren&#39;t more people there for brunch actually. <br><br>While they do have brunch fares 8-12 pounds and lunch was more around 10-15, they also had the amazing option of smoked salmon on brioche for a mere 4.50. What a steal, given the portions were absolutely perfect. Seems like there&#39;s a wider range of prices than at Caravan down the street. Had a 1 pound scoop of elderflower ice cream, which was so sweet and delicate (how have I never had this before!). The server also recommended a peanut butter ice cream. <br><br>I see there&#39;s a Yelp deal (free glass of champagne) and there was a great looking 12 pound oysters and champagne deal they had going. Better go back and try that!",
