"categorystrlist":"Japanese",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ZosP2YJHNyvXJRV38XF0WQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Wagamama continues to be my favorite place to go when I visit the UK.  The minute I see one, the decision regarding what to have for lunch comes to an end.  So I was very happy when the familiar sign caught my eye after a walk from Fulham.<br><br>We sat facing the window overlooking Earl&#39;s Court Road.  I ordered the grilled fish ramen, which I&#39;d never had before.  It was, as all their ramens are, wonderfully delicious.  Big pieces of various types of seafood - a big flaky fillet in the middle, some mussels (not in shells), squid, and probably other seafood I forgot.  Broth was hot and incredibly flavorful, noodles perfectly slurpable.  This bowl of hot goodness totally hit the spot.<br><br>Service wasn&#39;t so great, water never refilled and took forever to get the bill.  But I&#39;d sit through a lot worse for my favorite ramen!",
