"reviewcomment":"Sergio&#39;s is not a place that would normally attract me, but I found myself here for Eurovision this year with a large group. <br><br>This restaurant has to be the most accommodating place. Normally when confronted with 60 of us you&#39;d see smaller choice, flustered waiters and a general frenzie. The main man Ronnie put on an amazing spread for us. We were all sat in the beautiful downstairs area, an intimate cave. He&#39;d provided game sheets, balloons and even prizes. <br><br>The waiters took all 60 of us ordering multipul different things in their stride and were polite and attentive throughout. There was such a big choice on the menu and when the food came out I can&#39;t think of one person who was disappointed. <br><br>Fresh, simple, hot Italian food. Comforting and delicious.<br><br>We all had such a great night with this place going above and beyond!!",
