"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/mUvzkn7SUGb5UW9j3huDOw/l.jpg",
"rating":"3.0",
"reviewcomment":"I popped by Aqua Neuva on Saturday for lunch and it was much quieter than Aqua Kyoto. Nevertheless, the staff were fantastic as was the food!<br><br>We tried the £25 for three course lunch menu, which came with a glass of cava. As we had no allergies and eat pretty much everything, we let the chef loose and he impressed! Each course was perfectly presented and bursting with flavour. Though small in size, we finished the meal with full bellies. I&#39;ve seen reviews which talked about the chef&#39;s inflexibility but it didn&#39;t seem the case today. <br><br>The first course was a delicate potato and chorizo dish, followed by a chickpea and octopus dish, rounded out by the tenderest pork dish. I&#39;m not doing these dishes justice at all! For the price, I thought the meal was great value as everything was of top quality.<br><br>On a nice day, everyone must visit the terraces. There aren&#39;t many places in that area where you can enjoy a nice glass of cava while the streets bustle below!",
