"reviewcomment":"Great cosy venue with lots of seating and happy every night. <br><br>Went here with some friends before dinner for a few drinks.  After doing a quick search online this place came up as having a happy hour even on a sat eve, which is great for central London.  <br><br>They have a great drinks menu and there is quite a good choice when it comes to half price drinks (this was 5-9pm on a sat). We were advised on arrival it is best to book, however we still managed to grab a table for our group of 5.  There are candles, comfy chairs an the area goes back quite a bit. There is music but it&#39;s more ambient so you can easily have a conversation  and there is other lighting within the the venue so you can still see easily.<br><br>They have table service (they will charge you an extra 12% for service charge), there is also food available, but nothing really light that I could have eaten before going for a meal.<br><br>The only thing that let this place down was the toilets. After sitting the beautiful and decadent bar the ladies weren&#39;t as nice, looked like need a luck of pain and there was no soap.",
