"rating":"4.0",
"reviewcomment":"My partner and I went to Chor Bizarre for lunch one day, and overall, I felt that it was very good Indian food, but felt a little tricked by the waitress. We were walking around Mayfair and ask the concierge at the Athenaeum Hotel for some good Indian food in the area, and he recommended this place. He called ahead, though that wasn&#39;t really necessary because the place was empty for lunch.<br><br>Unfortunately, we were not able to spend a very long time at this restaurant because we had to quickly leave to make our plane back to America. We started with the chutney nadroo (crispy lotus root tossed in tamarind chutney, fennel seed and onion seeds), which were very light and acted as a great amuse bouche. For entree, we ordered the cauliflower and chicken biryani and some bread garlic roti (as well as a chicken dish I forget). They were without except very good,. We both love Indian food, and this is some of the best we&#39;ve had.<br><br>However, I do think to a certain extent that the hostess pulled a fast one on us. They knew that the Athenaeum Hotel had just called for us, so for whatever reason, they did not give us a lunch menu and only gave us the full dinner menu even though we were rushed. Knowing that we had to leave very soon, why give us the menu with the tandoori options that take forever to cook? We didn&#39;t think to ask for lunch menu because we thought it would be provided to us if they had it, so instead of an affordable and quick Indian meal, we had all these dinner portions that we could not possibly finish nor actually take back home with us because of customs. What good is that? So while the food was very good we did feel a bit taken advantage of by the hostess.<br><br>Also, this place was a bit difficult to find. There&#39;s another Indian restaurant on that same street that we went into, and that one also looked very nice. The vibe inside Chor Bizarre was very classic and traditional, and I really liked it.<br><br>Overall, I would definitely recommend Chor Bizarre for Indian food. They had a good number of choices, and the food was delicious. But unfortunately, because we felt a little tricked, I can&#39;t really give them a perfect score.",
