"reviewcomment":"I only recently discovered this place and am so glad I did and surprised I hadn&#39;t found it earlier particularly due to its fantastic location! <br><br>I found it for a work event I was organising and it went down very well with our guests who loved it and I must say the staff were excellent, from Dania who coordinated our event to the bar staff, everyone was so helpful, friendly, attentive and efficient. I would highly recommend the venue and the space is fantastic. <br><br>Also, the loos are brilliant with Turkish style carpets lining the walls and a mini bookshelf in there too! <br><br>I recently returned with a couple of friends for a drink pre-dinner and that was just as nice and successful a visit too. We also considered eating there too but had pretty much already made our mind up to go elsewhere. I would like to return to try their menu as it looked great and reasonable too. <br><br>Located in Heddon Street in the Food Quarter just off Regent&#39;s Street, The Living Room is in the heart of town so very handy for either Piccadilly or Oxford Circus tube stations (it&#39;s halfway between both) or numerous bus stops!<br><br>Would return and do recommend!",
