"rating":"4.5",
"reviewcomment":"Loved our meal here.<br>We popped in for dinner having listed Sacre Coeur as one of the local restaurants on my &#39;to try&#39; list and glad we did.<br>We were welcomed in and shown to a table. It&#39;s a homely, cosy bistro style interior and small, intimate tables but perfect for two or a small group.<br><br>The menu is straightforward French classics. There were several dishes that looked good and with the waitress reco I ordered the boeuf bourguinon. A generous portion with large meltingly tender chunks of beef, plenty of mushrooms and a great sauce. Just what I was hoping it would be. Served with mashed potatoes, it was a perfect comfort dish.<br><br>My partner&#39;s choice of pan fried king prawns with vodka and chili was an equally good choice and perfectly cooked and flavoured.<br><br>We shared a perfectly executed tarte tatin for desert with ice cream. A good sized portion as it should be and just right.<br><br>Service was great, unobtrusive yet attentive and just the right timing. Value for money was also excellent.  Looking forward to going back.",
