"rating":"4.0",
"reviewcomment":"So a friend I haven&#39;t seen for a while, who lives quite far away, comes to visit. Her train comes to paddington so I think we will have a quick lunch somewhere near and then head out. I remember this place that I had been meaning to try- it was so good we ended up staying for 7 hours!! <br><br>It is so easy to find but yet still feels tucked away. I wasn&#39;t sure when I walked down the stairs if my friend would be ok with it, she  is more of a high end sort of person, but it has quickly become her go to place when in london. <br><br>When we arrived, at 12 on a Sunday, we were offered food from the buffet as menu service didn&#39;t start until 1. I was actually really pleased as it meant trying a few different delicious dishes instead of just one. The value is amazing - I think it was £4.50 for 2 curries and vegetable sides and rice. In fact as we stayed we tried a number of deserts, drinks including Malaysian tea and a drink with jelly in it and took some deserts to go for others and it was still less than £15 each.   Everything we tried was very tasty!<br><br>I wouldn&#39;t usually stay for so long in one place but we had loads to catch up on, and the staff were so lovely about it - it wasn&#39;t busy so they were happy for us to stay. I will definitely be returning and I know my friend already has, and everyone who I gave the deserts to is planning a trip also!",
