"rating":"3.0",
"reviewcomment":"Went again for dinner last night with my boyfriend and we had the set menu B with a bottle of white. Service this time was perfect. Everyone was friendly, efficient and anything extra that we needed was brought promptly. The sampler platter was good. Mostly fried things, and the ribs were a little too sweet for my liking ( as was the sweet and sour pork) but still good. Spring rolls were crisp without a trace of grease and the sesame shrimp on toast was very good, too. <br><br>Aromatic duck was the perfect second course, although, again-- more deep fried food.<br><br>The black bean shrimp were slightly spicy with lots if crunchy peppers and the fried rice seemed to look sticky and glue -like but it turned out to be among some if the best fried rice I&#39;ve had. Vegetable portion was small, but I love those little straw mushrooms and the way their texture contrasts with the water chestnut and crunchy snow peas.<br><br>Overall, it was a great dinner. The place is almost always busy and last night was no exception. This is always a good sign. <br><br>I think this little corner has won me over!",
