"rating":"3.5",
"reviewcomment":"Interesting spot that is targeted toward the a nightlife atmosphere. Awesome space with a nice ambiance. Sadly, service is only good when they are required to serve you. Food is great and even comparable to a similar location in Los Angeles. <br><br>Service<br>From the beginning, I thought the service was solid. The wait staff seemed knowledgeable about the menu and reasonable about their recommendations. For the most part they were also attentive and prompt in bringing our drinks and food. BUT, the second our menu completed (we got a tasting menu) then service pretty much ended. No one checked in and it took several attempts to get any wait staff to come to our table. Rather annoying when trying to end the night and get home.<br><br>Food<br>Overall good food. If you&#39;re willing to spend, then do what we did and grab the Tasting Menu. No one really looked at what was apart of it, but all solid dishes that portioned out well to not be overfilling. I don&#39;t remember every dish, but the anticucho dish was nice. Ceviche and gyoza were also excellent. The sushi sampling was also well executed.<br><br>Overall happy with the place. Of note, the bathroom is a trip with it lit up in the basement. Anyways, I would say try this place out for a nice place for dinner and drinks.",
