"rating":"4.0",
"reviewcomment":"Myself and two friends from the United States rent motorcycles every year (from Guildford Harley Davidson) and come to the UK and get lost for 10 days. Even though you people drive on the wrong side of the road - we still have a great time. People are fantastic! Last summer we had the opportunity of visiting Ace Cafe AFTER we returned our bikes - so we showed up in a four-wheeler, but still had an excellent time! The parking lot was full of old and new bikes of all makes, models and sizes, Everyone was friendly and I loved talking to the folks who were just hanging out and got a chuckle out of my accent (I didn&#39;t know Americans had accents). Food was typical old-style &#34;on the road&#34; food. But, you don&#39;t come here to eat - you come here to socialize and watch kids pop wheelies on 1,000 cc Kawasaki&#39;s. We will be back in September. <br>Jim<br>Fredericksburg, Virginia (USA)",
