"rating":"4.0",
"reviewcomment":"I heard a lot about this place but never tried it till today and I have to say that it is really worth a try (or two, or three...)<br><br>If you see it from the outside, you won&#39;t find anything fancy here, but if you step inside, you&#39;ll find a cheap and nice menu and helpful and cheerful staff.<br><br>We went for late breakfast/brunch and, as per recommendation, I went straight to have a look at the pancakes menu. Amazing how for just  £5-£6 you can have a massive breakfast with coffee included.<br><br>I ordered &#39;Pancake menu #2&#39; as I&#39;m not too fond of having my sweet and savoury food mixed together and when it came I was like &#39;wow&#39;: tomatoes, scrambled eggs, bacon, pancakes and fruit!<br><br>The orange juice was pretty good as well and the coffee was just OK, but if your dish is full of delicious food, who cares?<br><br>Definitely, saving this spot as one of my favourite places to have a massive breakfast!",
