"categorystrlist":"Clubs,         Bars,         British",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/LBUeR2v-9-tD89I1AE4hOQ/l.jpg",
"rating":"3.0",
"reviewcomment":"This review is long overdue.<br><br>Once upon a time I lived in London for a 3 month period.<br><br>One of my best friends is London born and raised and I the American was in for an endless night of blasting music and not returning home until the sun was already up again.<br><br>This is how Leicester Square works:<br><br>First and foremost, it is the clubbing capital of the city. It has a Las Vegas feel because of the promoters are trying to get you to go to their club. Moreover, everyone is dressed up and no one wants to wait in line.<br><br>Suddenly we find our way to the front of the line at Penthouse. All I&#39;m thinking is what did I just get myself into. My LDN Girl Nat explained that this venue has 3 floors, which means 3 different music scenes.<br><br>Nonetheless, I had myself a smashing good time!<br><br>I remember the staff was friendly, the club wasn&#39;t too crowded, and the music was my kind of jam.<br><br>Until next time, wear comfortable shoes!",
