"rating":"4.0",
"reviewcomment":"5 Stars for being hands down the best, most entertaining, most original and strange little place that a trip for a kebab will afford you in our fair city. I don&#39;t know if I&#39;ve ever seen a bouncer on a kebab house elsehwere?!<br><br>It&#39;s brilliant in here! Not done with your night when the pubs close? Well then head on over to Marathon and get your fill! You can usually get drinks at a late hour too although I&#39;m not sure this is entirely above board so you might find the availability of Red Stripe cans fluctuates with how regularly the local rozzers are passing by! They keep the music going, mostly crazy hillbilly rock and the odd bit of live music too.<br><br>The food is surprisingly good - and there&#39;s a huge range too. I&#39;ve been known to invest in a chicken shish kebab with a side or taramasalata! Lord knows why, but hey, I&#39;m in Marathon and I wont be judged!<br><br>For me a night out in Camden just isn&#39;t complete without a jaunt to Marathon.... bravo.",
