"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/73J26Qmzk-brtZw-fcvzlw/l.jpg",
"rating":"3.5",
"reviewcomment":"I was greatly impressed by the remarkably high ceilings, huge windows and beautiful art deco chandeliers. Having the entrance to the restaurant outside Whiteley&#39;s helps diminish the feeling of eating in a shopping mall.<br>I came with a large group in January for a much delayed Christmas party and we were well attended by the staff. I cannot fault the food. We had an amuse bouche of parmesan cream with anchovy bread, delicious. I chanced having a salmon mousse, never been a big fan and have not had one for years. This mousse was dense and creamy, covered in little brown shrimps. I really enjoyed it, but was unable to finish it, as it was quite heavy. For main I had baked radicchio with Fontina, moreish and inventive. Dessert was a slice of intense chocolate tart, with crème fraiche.<br>Most of the people dining looked like people who lunch. Lucky them.<br>They do a number of menu deals that are reasonable, especially considering its glamorous furnishings.",
