"rating":"4.5",
"reviewcomment":"El Parador, Spanish for the Inn, and not to be confused with Beck&#39;s mid-nineties hit where he sings &#39;soy, un perdedor (I&#39;m a loser)&#39;, is a deliciousness Spanish Tapas establishment right behind Mornington Crescent station.<br><br>Now, I&#39;ve been to this area A LOT. Largely due to Koko&#39;s being right there. But this was my first attempt at going to El Parador. We didn&#39;t make a reservation, but were able to be accommodated in a matter of minutes, which was great. They have a good selection of Beef, Chicken, Lamb,  Veggies &amp; Seafood. Although due to lack of desire and potential of death respectively, I abstained from the last two. However, the winner of the night clearly was the SALTEADO de SOLOMILLO; which is fillet steak marinated w/ thyme, garlic &amp; cracked blk pepper with caramelised leeks, butter &amp; Ruby Port. OH EMM GEE, delicious! Followed not too far behind was the ALBONDIGAS or pork meatballs. <br><br>The pricing is incredibly reasonable, the food and service is exceptional, and the overall vibe and proximity to nightlife is great! I highly recommend this place and will hopefully return there soon.",
