"reviewcomment":"I&#39;ve been coming to this place for about 2-3 yrs. it&#39;s just had a total refurbishment after buying the shop next door.<br><br>Firstly the new restaurant looks awesome, it&#39;s kept the old French style decor but it&#39;s double the size. They have used the new space for more seating and also added a small cafe area which serves coffees and crepes. Brilliant idea.!<br><br>The food is lovely, I had mussels to start with a cream and vegetable sauce and rib eye steak with chips for mains. Steak was cooked just wright. <br><br>My girlfriend had duck in a French style sauce which looked lovely. <br><br>The menu also consists of many traditional French courses I.e snails, frog legs. <br><br>The portions are perfect and the service was very quick considering the restaurant was 85% full. <br><br>The prices are good given the restaurant is in a nice part of islington, North London. £13 for the rib eye steak <br><br>I will defo be returning.!!!!!",
