"reviewcomment":"We were searching for a place to eat on Guy Fawkes Day and ended at Palm Court Brasserie.  Walking in, it looks like a posh bar/gastropub with very dim lighting and loud talking.<br><br>Service:  Our waiter was very nice and answered all of our questions.  <br><br>Ambience:  very dark with candle lighting and pretty loud.  Dress smartly - it seems like Palm Court is dominated by business people...<br><br>Food:  we unfortunately missed the pre-theater menu, which is a really awesome deal.  Instead, we ordered individual dishes, which surprisingly impressed me.  I had the special - a beautifully done mahi mahi over a bed of mashed potatoes and vegetables.  Paired with a glass of crisp, Marlborough Sauvignon blanc, it was just what I needed to fill a hungry stomach.  For dessert, our waiter suggested the banoffee pie,  I normally love banoffee, but I couldn&#39;t take more than 3 bites of this because of how sweet and heavy it was...  And the crust was just so dense! <br><br>I would suggest this restaurant to those who are going for the pre-theater menu because the food is worth that price but not that of the regular menu.",
