"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/fd0sd8AuXrCW5DhH5_rrEg/l.jpg",
"rating":"3.0",
"reviewcomment":"Alright, I&#39;ve been back a few times now (I&#39;m the freaking Duchess, yo!) and though I have still not sampled the pho (next time I promise. maybe.) I feel like an update is in order.  <br><br>I just had the pork banh mi which was just magical.  MAGICAL!!!  The baguette was soft and warm and the fillings were all fresh, chilled, crisp and lovely.  I was given the option for spicy (with fresh chilies) which I hesitated on because I&#39;m not a huge spicy fan.  I asked for a little and didn&#39;t appear to be given any which means I can totally say yes next time and be fine.<br><br>I walked around the neighbourhood for a bit before just heading here, looking for another place in the neighbourhood to get banh mi.  There isn&#39;t any.  At least not that I could find.  A bit disappointed by my options but at least the sole joint offering banh mi goodness is a five star, £5.50 option.",
