"rating":"4.0",
"reviewcomment":"First things first, I was here last year and had the rabbit, which is now ruined for me. Because after you&#39;ve eaten at The Square, whatever type of meat/seafood you ate there will forever make you a snob. That&#39;s right, I can not eat rabbit anywhere else now, because they rocked my world.<br><br>The restaurant atmosphere is sophisticated and very formal. There&#39;s a dress code in place, and eating was a little stiff. This isn&#39;t the type of place that would welcome walk-ins. <br><br>The starter bread was delicious, as they come around with a selection for you to chose. The appetizers were delightful and beautifully arranged, and light enough that you wouldn&#39;t worry about filling up fast.<br><br>Then you have your main course. This place is michelin rated for a reason. The balance of flavors was wonderful, they give you just enough to satisfy, but not enough to gorge yourself on.<br><br>And then the dessert was a light touching after. Perfectly balanced. <br><br>Go, dress up, eat, and enjoy. You don&#39;t eat a meal like this every day, it&#39;s something to be savored and really a pleasure to have dined here.<br><br>Also, even though I&#39;m not big on wine. The list was superb.",
