"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/j2S1X42QlUGWF8dZTQzoBQ/l.jpg",
"rating":"4.0",
"reviewcomment":"My favorite place to go in Chinatown.  The restaurant is really tiny, so there is usually a queue by the door, but usually half of the people waiting are waiting on takeaway orders.<br><br>A HK-cafe style (茶餐廳) restaurant, that also does good Malaysian style hawker food.  My favorite thing to get here is the Malaysian rice noodles in egg sauce (滑蛋河).  They come out in a giant bowl full of seafood, fish cakes, pork, charred rice noodles, swimming in an eggy sauce.  They give you a small dish of chilis to dump in as you please.  Their roast pork (燒肉) and bbq duck (燒鴨) are also excellent. <br><br>My only disappointment is that they do not open before noon on weekends.  This isn&#39;t any different than most of the other Chinatown restaurants, but it still annoys me.  Aren&#39;t Chinese restaurant owners typically known for being industrious?  If I find myself lurking around Chinatown before noon and starving, I&#39;ll usually go next door to Old Town 97.",
